INSERT INTO `mcat_brands` VALUES
(1, 'AMD', '', '1.jpg', ''),
(2, 'Intel', '', '2.jpg', ''),
(3, 'Asus', '', '3.jpg', ''),
(4, 'Gainward', 'http://www.gainward.com/', '4.jpg', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td>\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\n				<tbody>\n					<tr>\n						<td><strong>Дата основания: 1984 год</strong></td>\n					</tr>\n				</tbody>\n			</table>\n			Деятельность: Производство и продажа видеокарт<br />\n			Входит в группу компаний PALIT Group (Мировой лидер VGA индустрии)<br />\n			Штат в Европе: 20 сотрудников\n			<p> </p>\n\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\n				<tbody>\n					<tr>\n						<td><strong>Наши представительства:</strong></td>\n					</tr>\n				</tbody>\n			</table>\n			Штаб-квартира в Тайбэе(Тайвань) <br />\n			Центральное европейское представительство  в Мюнхене (Германия)<br />\n			Офисы продаж в Китае</td>\n		</tr>\n	</tbody>\n</table>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td> </td>\n		</tr>\n		<tr>\n			<td><strong>Наши производственные комплексы:</strong></td>\n		</tr>\n		<tr>\n			<td>Shenzhen (Китай).<br />\n			Wugu Taipei (Тайвань).</td>\n		</tr>\n	</tbody>\n</table>\n'),
(5, 'Gigabyte', 'http://www.gigabyte.ru/', '5.jpg', '<p>Компания GIGABYTE была основана в 1986 году и с тех пор занимает лидирующие позиции на рынке инновационных ИТ-технологий. Залогом успеха компании является использование новейших технологий и соблюдение строгих стандартов качества. Своевременно реагируя на запросы рынка, компания GIGABYTE в настоящее время предлагает в ассортименте материнские и графические платы, периферийные устройства для ПК, настольные компьютеры (включая изделия All-In-One), ноутбуки, планшетные компьютеры, сетевое оборудование, серверы и мобильные телефоны. Широкий спектр продукции GIGABYTE полностью отвечает желаниям и потребностям каждого пользователя и каждой компании. </p>\n'),
(6, 'MSI', 'https://ru.msi.com/', '6.png', '<p>Являясь мировым лидером игровой индустрии, компания MSI ставит перед собой цель стать наиболее уважаемым брендом в мире гейминга и киберспорта. Мы посвятили бессчётное количество часов и вложили солидные ресурсы в поддержку самых амбициозных звёзд игрового мира, использовав их навыки, знания и опыт в создании наших продуктов. Приверженность к разработке и производству исключительно собственными силами позволяет MSI реализовывать инновационные идеи в собственных решениях и постоянно оптимизировать их архитектуру.</p>\n'),
(7, 'Palit', 'http://www.palit.com/palit/index.php?lang=ru', '7.jpg', '<p>Компания Palit Microsystems Ltd., основанная в 1988 году, известна благодаря производству надежных, технически изящных и инновационных графических ускорителей. Являясь одним из основных производителей компонентов для ПК, Palit поставляет передовые видеокарты стабильно высокого качества по всему миру. Головной офис Palit расположен в Тайбэе на Тайване, логистический центр в Гонконге, фабрики в материковом Китае, в Германии находится филиал компании. Palit создала всемирную сеть продаж и тесно сотрудничает со всеми клиентами. <br />\n </p>\n'),
(8, 'Point of View', 'http://www.pointofview-online.com/default.php?content_id=35', '8.jpg', '<p>Компания Point of View была основана в 2000 году и является хорошо известным производителем графических адаптеров на чипсетах NVIDIA. С момента основания компании продажи графических адаптеров с каждым годом растут в геометрической прогрессии, а сам бренд получил признание в более чем 70 странах по всему миру.</p>\n'),
(9, 'Sapphire', 'http://www.sapphiretech.com/default.asp?lang=rus', '9.jpg', '<p>Компания SAPPHIRE Technology - ведущий производитель и всемирно известный поставщик инновационных компьютерных компонентов для домашнего и для профессионального использования. Начав с разработки и производства видеокарт, компания постепенно добавила в свой ассортимент широкий спектр профессиональной графики и встроенных решений. Компания была основана в 2001 году, штаб-квартира располагается в Гонконге.</p>\n'),
(10, 'PowerColor', 'http://www.powercolor.com/ru/default.asp', '10.png', '<p><strong>PowerColor</strong>, established by <strong>Tul Corporation</strong> in 1997, is a graphics industry leading brand name now and well known for its outstanding performance and innovative technology. As a leading provider of graphics card, PowerColor offers powerful, reliable and cost-effective solutions to customers worldwide. </p>\n\n<h5> </h5>\n'),
(11, 'HIS', 'http://www.hisdigital.com/ru/', '11.png', '<p>HIS - это всемирно известный бренд видеокарт. Снова и снова, его сравнивают и испытают сотни мировых известных критиков. HIS доказали, что могут предложить гораздо более высокие, более холодные, более тихие, и быстрые графические карты, чем любые другие ведущие конкуренты. До первого квартала 2015 года HIS завоевала более 1700 наград на базе графических решений AMD. HIS в настоящее время признается во всем мире, обеспечивая высочайшую производительность и наградами продукты: IceQ, IceQ X, IceQX2, IceQX2II, OC и Turbo Edition.</p>\n'),
(12, 'XFX', 'http://www.xfxforce.com/en-us', '12.jpg', '<p>XFX – это один из лучших партнеров NVIDIA® по видеокартам и лидер в сфере игровой графики и видеокарт. XFX предлагает широчайшие диапазон видеокарт NVIDIA GeForce® и материнских плат NVIDIA NForce®. XFX является мировым лидером по объемам видеокарт на базе NVIDIA®. NVIDIA является мировым лидером в сфере технологий программируемых видеоигр и графических процессоров.</p>\n'),
(13, 'Zotac', 'https://www.zotac.com/ru', '13.png', '<p>Начав как небольшой производитель графических карт, со временем Zotac существенно расширили спектр предлагаемых продуктов. Создав широкую линейку компактных систем — от оригинальных мини-ПК, которые являются полноценной альтернативой традиционным настольным компьютерам, до максимально компактных мини-ПК, поддерживающих четырехмониторные конфигурации. Zotac заняли лидирующие позиции в этом сегменте, предложив эффективные решения для промышленности, дома и офиса. </p>\n'),
(14, 'Leadtek', 'http://www.leadtek.com/ru/', '14.png', '<p>\"Инновации и качество\" – это ключевые факторы нашей корпоративной политики. Мы не перестаем подчеркивать важность сильной команды по исследованиям и разработкам при условии соблюдения высокого качества продукции с дополнительными ценными возможностями.</p>\n\n<p>Благодаря этим принципам наши продукты продолжают не только собирать награды в профессиональных изданиях и на выставках во всем мире, но и заслуживать уважение и доверие участников рынка.</p>\n'),
(15, 'Manli', 'http://www.manli.com/en', '15.png', '<p>Established in 1996, Manli Technology Group Ltd. has been one of major manufacturers and suppliers of Computer Graphics Cards, MiniPCs, 3D Printers and other peripherals/components. With the severe quality control and innovative R&D team, Manli\'s products mean performance, reliability and conformance.</p>\n'),
(16, 'ECS', 'http://www.ecs.com.tw', '16.jpg', ''),
(17, 'ASRock', 'http://www.asrock.com/index.asp', '17.png', ''),
(18, 'Biostar', 'http://www.biostar.com.tw/app/ru/', '18.jpg', '<p>Компания Biostar далеко не новичок в компьютерном мире, она была образована в 1986 году, однако до недавних пор её продукция не привлекала нашего интереса. Ничего удивительного, ведь производимые материнские платы обладали вполне заурядными характеристиками. Но постепенно ситуация стала меняться, в частности не раз доводилось слышать хвалебные отзывы о материнских платах Biostar на чипсете nForce 4. Одна неплохая плата – это может быть просто случайность, но вторая хорошая – это уже тенденция, в следствии чего появились благожелательные отклики на платы Biostar,</p>\n'),
(19, 'Foxconn', 'http://foxconn.ru/', '19.jpg', '<p>Foxconn — мировой лидер в разработке, производстве и поставках компьютерной, коммуникационной и бытовой электроники, а также материнских плат, систем охлаждения, графических (видео-) карт, платформ для сборки ПК, корпусов для ПК и серверов. Foxconn работает с распределённой сетью дистрибьюторов и OEM-компаний в США, Европе, Азии и Латинской Америке.</p>\n'),
(20, 'Acer', 'http://www.acer.com/ac/ru/RU/content/home', '20.jpg', ''),
(21, 'DELL', 'http://www.dell.ru/', '21.png', '<p><strong>Dell</strong> — американская корпорация, одна из крупнейших компаний в области производства компьютеров. Входила в список <a href=\"https://ru.wikipedia.org/wiki/Fortune_1000\" title=\"Fortune 1000\">Fortune 1000</a> (26-е место по итогам 2005 года), акции торговались на бирже <a href=\"https://ru.wikipedia.org/wiki/NASDAQ\" title=\"NASDAQ\">NASDAQ</a>, с 2013 года — частная компания<sup><a href=\"https://ru.wikipedia.org/wiki/Dell#cite_note-4\">[4]</a></sup>. Штаб-квартира находится в <a href=\"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%83%D0%BD%D0%B4-%D0%A0%D0%BE%D0%BA_(%D0%A2%D0%B5%D1%85%D0%B0%D1%81)\" title=\"Раунд-Рок (Техас)\">Раунд-Роке</a> в штате <a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D1%85%D0%B0%D1%81\" title=\"Техас\">Техас</a> в <a href=\"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"Соединённые Штаты Америки\">США</a>.</p>\n'),
(22, 'Fujitsu', 'http://www.fujitsu.com/ru/', '22.gif', '<p><strong>Fujitsu Limited</strong> (<a href=\"https://ru.wikipedia.org/wiki/%D0%AF%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Японский язык\">яп.</a> 富士通株式会社, <em>Фудзицу кабусикигайся</em>) (<a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BA%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%84%D0%BE%D0%BD%D0%B4%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B1%D0%B8%D1%80%D0%B6%D0%B0\" title=\"Токийская фондовая биржа\">TYO</a>: <a href=\"http://stocks.us.reuters.com/stocks/overview.asp?symbol=6702.T\" rel=\"nofollow\"><strong>6702</strong></a>) — крупная японская корпорация, производитель электроники и ИТ-компания. Работает на глобальном уровне, имеет дочерние подразделения во всем мире.</p>\n\n<p>Исторически компания Fujitsu была основана под именем «Fuji Tsushinki Manufacturing Corporation» как отделение коммуникационного подразделения компании Fuji Electric, и логотип представлял собой комбинацию букв «f» и «s».</p>\n\n<p>Почему именно этих букв? — «Fu» от слова Furukawa и «Ji» от слова Siemens (в японском произношении).</p>\n\n<p>С момента образования компании в 1935 году до наших дней логотип неоднократно видоизменялся, а с выходом компании на глобальный рынок был создан его современный дизайн, легко читающийся на разных языках мира.</p>\n\n<p>Знак бесконечности, размещенный над буквами «j» и «i», объединяет в себе образы Земли и Солнца и символизирует Вселенную с безграничными возможностями, а фирменный ярко-красный цвет выражает энтузиазм по отношению к будущему и готовность прийти на помощь.</p>\n'),
(23, 'HP', 'http://www8.hp.com/ru/ru/home.html', '23.jpg', '<p><strong>Hewlett-Packard</strong> (<strong>HP</strong>, <em>Хью́летт-Па́ккард</em>) — одна из крупнейших <a href=\"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"Соединённые Штаты Америки\">американских</a> компаний в сфере информационных технологий, существовавшая в период 1939—2015 годов, поставщик аппаратного и программного обеспечения для организаций и индивидуальных потребителей. Штаб-квартира — в <a href=\"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%BE-%D0%90%D0%BB%D1%8C%D1%82%D0%BE\" title=\"Пало-Альто\">Пало-Альто</a> (<a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F\" title=\"Калифорния\">Калифорния</a>).</p>\n\n<p>Производила и поставляла решения в области <a href=\"https://ru.wikipedia.org/wiki/%D0%98%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B5_%D1%82%D0%B5%D1%85%D0%BD%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D0%B8\" title=\"Информационные технологии\">ИТ</a>-инфраструктуры, персональных вычислительных систем и устройств доступа, оказывала услуги по <a href=\"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%BD%D0%B0%D1%8F_%D0%B8%D0%BD%D1%82%D0%B5%D0%B3%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"Системная интеграция\">системной интеграции</a>, сервисной поддержке и аутсорсингу, выпускала устройства печати и средства вывода изображений.</p>\n\n<p><a href=\"https://ru.wikipedia.org/wiki/1_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"1 ноября\">1 ноября</a> <a href=\"https://ru.wikipedia.org/wiki/2015_%D0%B3%D0%BE%D0%B4\" title=\"2015 год\">2015 года</a> разделена на две компании: <a href=\"https://ru.wikipedia.org/wiki/HP_Inc.\" title=\"HP Inc.\">HP Inc.</a> и <a href=\"https://ru.wikipedia.org/wiki/Hewlett_Packard_Enterprise\" title=\"Hewlett Packard Enterprise\">Hewlett Packard Enterprise</a>.</p>\n'),
(24, 'Samsung', 'http://www.samsung.com/ru/support/', '24.jpg', '<p><strong>Samsung Group</strong> (произносится <em>«Сáмсунг Груп»</em>, <a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Корейский язык\">кор.</a> <a href=\"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BD%D0%B3%D1%8B%D0%BB%D1%8C\" title=\"Хангыль\">삼성그룹</a>, <em><a href=\"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D1%80%D0%BE%D0%BC%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%BA%D0%BE%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Новая романизация корейского языка\">Samseong Gurub</a></em>, <em><a href=\"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9C%D0%B0%D0%BA%D0%BA%D1%8C%D1%8E%D0%BD%D0%B0_%E2%80%94_%D0%A0%D0%B0%D0%B9%D1%88%D0%B0%D1%83%D1%8D%D1%80%D0%B0\" title=\"Романизация Маккьюна — Райшауэра\">Samsŏng Gurup</a></em>) — <a href=\"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%9A%D0%BE%D1%80%D0%B5%D1%8F\" title=\"Республика Корея\">южнокорейская</a> группа компаний, один из крупнейших в <a href=\"https://ru.wikipedia.org/wiki/%D0%AE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%9A%D0%BE%D1%80%D0%B5%D1%8F\" title=\"Южная Корея\">Южной Корее</a> <a href=\"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D0%B1%D0%BE%D0%BB%D1%8C\" title=\"Чеболь\">чеболей</a>, основанный в <a href=\"https://ru.wikipedia.org/wiki/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 год\">1938 году</a>. На <a href=\"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D1%80%D1%8B%D0%BD%D0%BE%D0%BA\" title=\"Мировой рынок\">мировом рынке</a> известен как производитель <a href=\"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D1%81%D0%BE%D0%BA%D0%B8%D0%B5_%D1%82%D0%B5%D1%85%D0%BD%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D0%B8\" title=\"Высокие технологии\">высокотехнологичных компонентов</a>, телекоммуникационного оборудования, <a href=\"https://ru.wikipedia.org/wiki/%D0%91%D1%8B%D1%82%D0%BE%D0%B2%D0%B0%D1%8F_%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D0%BA%D0%B0\" title=\"Бытовая техника\">бытовой техники</a>, аудио- и видеоустройств. Главный офис компании расположен в <a href=\"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%83%D0%BB\" title=\"Сеул\">Сеуле</a>.</p>\n\n<p>Слово «Самсунг» (<a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Корейский язык\">кор.</a> 삼성<a href=\"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BD%D0%B3%D1%8B%D0%BB%D1%8C\" title=\"Хангыль\"><sup>?</sup></a>, 三星<a href=\"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BD%D1%87%D0%B0\" title=\"Ханча\"><sup>?</sup></a>, более правильная передача слова по <a href=\"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D0%9A%D0%BE%D0%BD%D1%86%D0%B5%D0%B2%D0%B8%D1%87%D0%B0\" title=\"Система Концевича\">нормам практической транскрипции</a> — «сáмсон») в <a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Корейский язык\">корейском языке</a> означает «три звезды». Возможна связь такого названия с тремя сыновьями основателя Samsung <a href=\"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8_%D0%91%D1%91%D0%BD_%D0%A7%D1%85%D0%BE%D0%BB%D1%8C\" title=\"Ли Бён Чхоль\">Ли Бён Чхоля</a> (이병철), младший из которых Ли Гон Хи (иногда его имя пишется Ли Кун Хи — калька с английского: Lee Kun-hee) (이건희) возглавил компанию в <a href=\"https://ru.wikipedia.org/wiki/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 год\">1987 году</a> в нарушение всех восточных традиций наследования, в согласии с которыми старший сын наследует большую часть семейной собственности</p>\n'),
(25, 'LG', 'http://www.lg.com/ru', '25.png', ''),
(26, 'BENQ', 'http://www.benq.ru/', '26.jpg', '<p><strong>BenQ Corporation</strong> (<a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">/</a><a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">ˌ</a><a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">b</a><a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">ɛ</a><a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">n</a> <a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">ˈ</a><a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">k</a><a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">juː</a><a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%A4%D0%90_%D0%B4%D0%BB%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%8F%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"Таблица МФА для английского языка\">/</a>; <a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Китайский язык\">кит.</a> 明基電通股份有限公司) — <a href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B9%D0%B2%D0%B0%D0%BD%D1%8C\" title=\"Тайвань\">тайваньская</a> компания по производству компьютерной техники и электроники. В <a href=\"https://ru.wikipedia.org/wiki/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 год\">2007 году</a> компания объявила о переименовании в <strong>Qisda</strong> («Quality Innovation Speed Driving and Achievements»)<sup><a href=\"https://ru.wikipedia.org/wiki/BenQ#cite_note-1\">[1]</a></sup><sup><a href=\"https://ru.wikipedia.org/wiki/BenQ#cite_note-2\">[2]</a></sup>.</p>\n\n<p>Под брендом BenQ будут выпускаться мобильные телефоны, <a href=\"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D1%83%D1%82%D0%B1%D1%83%D0%BA\" title=\"Ноутбук\">ноутбуки</a> Joybook, <a href=\"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%B8%D1%82%D0%BE%D1%80_(%D1%83%D1%81%D1%82%D1%80%D0%BE%D0%B9%D1%81%D1%82%D0%B2%D0%BE)\" title=\"Монитор (устройство)\">мониторы</a> и некоторая другая продукция, а вновь созданная Qisda займётся производством ЖК-мониторов, многофункциональных периферийных устройств и OEM-производством. При этом бренд BenQ будет полностью принадлежать Qisda. Введение новой торговой марки не предусматривается.</p>\n\n<p>По сути произошло разделение бизнеса компании на <a href=\"https://ru.wikipedia.org/wiki/OEM\" title=\"OEM\">OEM</a>/<a href=\"https://ru.wikipedia.org/wiki/ODM\" title=\"ODM\">ODM</a>-бизнес (производство комплектующих и продукции для сторонних торговых марок) и бренд-бизнес (продажа продукции под торговой маркой BenQ).</p>\n'),
(27, 'Philips', 'http://www.philips.ru/', '27.png', '<p><strong>Koninklijke Philips N.V.</strong> (<strong>Филипс</strong>, <a href=\"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"Английский язык\">англ.</a> <em>Royal Philips</em>) — <a href=\"https://ru.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"Нидерланды\">нидерландская</a> компания, бизнес которой делится на три основных направления: здравоохранение, световые решения и потребительские товары. Компания занимает лидирующие позиции в разработке оборудования для кардиологии, неотложной помощи и медицинского обслуживания на дому, в сфере энергоэффективных светотехнических решений и инновационных систем освещения, а также электробритв и средств личной гигиены, приборов и средств для ухода за полостью рта.</p>\n'),
(28, 'Aerocool', 'http://www.aerocool-russia.ru/en/', '28.png', '<p>Компания Aerocool является одним из лидеров рынка продукции для геймеров и энтузиастов. Продукция нашего бренда хорошо известна геймерам и энтузиастам всего мира. Мы предлагаем полную линейку продуктов, в том числе компьютерные корпуса для игровых систем, блоки питания, вентиляторы, мыши, клавиатуры, аудиогарнитуры, многофункциональные контроллеры управления вентиляторами</p>\n'),
(29, 'Crown Micro', 'http://www.crown-micro.com/ru/', '29.jpg', '<p>• 1992г. компания основывается как производитель корпусов, ИБП и блоков питания.</p>\n\n<p>• 2004г. расширяется линейка продукции и компания начинает производить потребительскую электронику, мультимедиа, периферию и аксессуары.</p>\n\n<p>• 2006г. компания покупается Кувейтским инвестиционным фондом, что по настоящее время гарантирует стабильное финансирование на любом этапе сотрудничества.</p>\n\n<p>• 2013г. начинается активное продвижение по направлениями офисной мебели и совместимых расходных материалов.</p>\n\n<p>• 2015г. компания имеет собственные производственные мощности по производству большинства линеек продукции.</p>\n\n<p>• 2015г. Открытие новых международных офисов компании. Офисы располагаются в России, Казахстане, Украине, ОАЭ, США, Китае, Индии, Пакистане, Кувейте, Гане, Катаре и других странах.</p>\n\n<p>2016г. открытие европейского склада в Гамбурге. Цель: обеспечения продукцией европейского потребителя и быстрая логистика в страны СНГ.</p>\n'),
(30, 'DNS', 'http://www.dns-shop.ru/', '30.jpg', '<p><strong>DNS, ДНС</strong> (Digital Network System — <em>англ. Система цифровых сетей</em>) — российская компания, владелец розничной сети, специализирующейся на продаже компьютерной, цифровой и бытовой техники, а также производитель компьютеров, в том числе ноутбуков, планшетов и смартфонов (сборочное производство). На середину 2015 года сеть насчитывает более 1200 магазинов в 400 городах России. Штаб-квартира компании находится во Владивостоке.</p>\n'),
(31, 'EVGA', 'http://ru.evga.com/', '31.png', '<p>EVGA - является партнером номер один компании NVIDIA. Основываясь на философии \"умных инноваций\", знаниях рынка и постоянной работе на достижение высокого результата, компания EVGA продолжает изучать существующие потребности и предлагать решения, превышающие ожидания. Предлагая целый спектр продуктов, круглосуточную поддержку и другие программы для партнеров, компания EVGA является явным лидером во всех категориях: электронной коммерции, ритейле, дистрибуции и системной интеграции. Штаб-квартира компании находится в Бреа, Калифорния, а дополнительные офисы расположены в Мюнхене, Майами, Гонконге.</p>\n'),
(32, 'FSP', 'http://www.fsp-power.ru/', '32.jpg', '<p>FSP Group (FSP Technology Inc.) - тайваньская компания, производитель блоков питания для различной техники (см.ниже). FSP - пятый по величине производитель блоков питания в мире. Основные линии продуктов включают</p>\n\n<p>Блоки питания для ПК и промышленных целей<br />\nODM или OEM Блоки питания<br />\nOpen Frame<br />\nБлоки питания для LCD телевизоров<br />\nАдаптеры питания<br />\nКорпуса<br />\nБатареи для телефонов<br />\nFSP имеет международные представительства с офисами в Великобритании, Германии, США, России, Японии, Индии, Корее, Китае, и с недавнего времени во Франции.</p>\n\n<p>FSP разработали свой собственный розничный бренд \"FSP\" в 2003 году. Блоки питания производства FSP продаются компаниями Antec, Sparkle Power International (SPI), OCZ, SilverStone Technology, Thermaltake, Nexus и Zalman под их собственными именами.[1]</p>\n\n<p>Также FSP выпускает широкий круг блоков питания для ноутбуков, источников бесперебойного питания (ИБП) и зарядных устройств для мобильных USB устройств.</p>\n\n<p>Также в 2012 представлена новая линейка продуктов - Amacrox.</p>\n'),
(33, 'HIGH POWER (by Sirtec)', 'http://www.sirtec.com.tw/', '33.jpg', '<p>Тайваньская компания Sirtec является самой известной компанией по производству блоков питания, но в то же время и не самой популярной. Многие потребители считают, что продукция этой компании является достаточно посредственной, но ведь именно Sirtec популярные блоки питания которые потом продает под своим знаменитым брендом, компания High Power.</p>\n\n<p>Ассортимент блоков питания High Power, инициалы компании составляют название всего модельного ряда, продукцию можно узнать по аббревиатуре «НРС» но в некоторых случаях можно встретить название которое начинается на «АТХ…».</p>\n\n<p>В ассортименте компании присутствуют блоки питания из серии 80 Plus Platinum с мощностью 500, 600, 1000 и 1200 Вт, а так же с небольшой мощностью в 250 и 300 Вт, они относятся к средней категории. Они предназначены для компьютеров. Так же блоки питания различаются по наличию вентиляторов с одним или двумя. Для охлаждения блоков в них установлены вентиляторы от 130 до 135 мм. Так же в наборе с блоком питания идут кабели – ATX, два PCI Express и EPS все они закреплены к блоку питания постоянно, остальные кабели можно отключать и подключать при необходимости.</p>\n'),
(34, 'HIPRO', 'http://www.hipro.com.tw/', '34.jpg', '<p>Головной офис компании Hipro Electronics Co., Ltd. находится в ВуКу (Тайпэй, Тайвань). Структура компании включает в себя административные, научно-исследовательские подразделения, службы продаж и технической поддержки, подразделения по работе с клиентами и производству опытных образцов. Система взаимной поддержки между подразделениями позволяет компании обеспечивать выполнение процедуры строгой проверки качества продукции. Таким образом компания Hipro поддерживает лидирующие позиции и долю на мировом рынке блоков питания.</p>\n\n<p><br />\nКомпания Hipro Electronics исповедует открытость и поддерживает принципы конкурентного ценообразования. Благодаря профессионализму научно-исследовательского подразделения и точности технических решений, компания Hipro Electronics продолжает обеспечивать потребителей продукцией высочайшего качества по конкурентоспособным ценам. Обширные производственные мощности в Таиланде, Донг Гуане, Китае (общая площадь - 1 440 000 квадратных футов) и 3 000 сотрудников позволяют компании добиваться максимальной производительности – 2.3 миллиона единиц продукции в месяц. Сплоченный коллектив и строгий контроль качества продукции позволяют грамотно развивать бизнес и обеспечивать высокую производительность.</p>\n'),
(35, 'ARGUS (Inner-Tech)', 'https://www.inter-tech.de/', '35.jpg', ''),
(36, 'MS-Tech', 'http://www.ms-tech.de', '36.jpg', '<p>MS-Tech, начиная с 2000 года ведет активную деятельность на европейском рынке, головной офис находится в Германии (Бохольт/НРВ).</p>\n\n<p>Занимается производством высоко-качественной продукции В аппаратной отрасли промышленности, которые представляют эргономически и экономически изображения.</p>\n'),
(37, 'OCZ Technology', 'https://ocz.com/', '37.jpg', '<p>OCZ Technology — производитель оперативной памяти и флеш-памяти. Начиная с выхода на рынок памяти, OCZ в своих продуктах прежде всего ориентировалась на компьютерных энтузиастов. Компания также занимается производством датчиков нервных импульсов (NIA), блоков питания, компьютерных систем охлаждения и других компьютерных компонентов. OCZ — одна из немногих компаний, которые стремятся создавать свои изделия с поддержкой стандартов XMP и EPP 2.0.</p>\n'),
(38, 'Thermaltake', 'http://www.thermaltakerussia.ru/', '38.jpg', '<p>Thermaltake, Ltd — тайваньская компания, занимающаяся разработкой компьютерных корпусов, кулеров, радиаторов, систем жидкостного охлаждения, блоков питания, кулеров для ноутбуков и аксессуаров для компьютера. Для производства используются мощности других компаний. Thermaltake Technology Co., Ltd. была основана в 1999 на Тайване, одновременно с американским филиалом, находящимся в Южной Калифорнии. Thermaltake обладает многочисленными наградами, включая Double Silver Medal 2008 года</p>\n'),
(39, 'Zalman', 'http://www.zalman.ru/global/main.php', '39.png', '<p>Zalman (За́лман, кор. 잘만) — южнокорейская компания, производящая системы охлаждения компьютера. Один из лидеров в индустрии. Делает акцент на бесшумность своей продукции. Имеет множество патентов в данной области. Кроме того, под брендом Zalman продаются компьютерные корпуса, блоки питания, аудиоустройства, термопаста, клавиатуры и мыши.</p>\n'),
(40, 'Chieftec', 'http://www.chieftec.eu', '40.gif', '<p>CHIEFTEC – мировой производитель первоклассных корпусов ПК, блоков питания и компьютерных комплектующих.</p>\n\n<p>Компания Arena Electronic GmbH, представляющая марку CHIEFTEC , входит в число ведущих предприятий компьютерной индустрии. Постоянные инновационные разработки, а также инвестиции в современное производственное оборудование по изготовлению десктопов, корпусов типа «башня» и промышленных корпусов подчеркивают стремление к абсолютному лидерству. Многочисленные награды прошлых лет подтверждают данный факт также в отношении блоков питания и компьютерной периферии.</p>\n'),
(41, 'HIPER', 'http://www.hiper-power.com/', '41.png', '<p>В 2001 году в городе Милтон Кейнс, Великобритания, была основана компания HIPER. </p>\n\n<p>Модельный ряд HIPER представлен широким спектром блоков питания для PC, внешних аккумуляторов, портативной bluetooth акустики и аксессуаров для мобильных устройств. </p>\n\n<p>При разработке новых продуктов компания HIPER делает ставку на высокое качество и надежность своих решений. </p>\n\n<p>Вся продукция HIPER соответствует современным требованиям безопасности и экологическим нормам. Обладая впечатляющей надежностью, функциональностью, современным дизайном и широким модельным рядом, компания завоевала доверие пользователей по всему миру. </p>\n'),
(42, 'ITZR', 'http://en.itzr.cn/', '42.jpg', '<p>Operating for over 13 years and certified to ISO9001, Shenzhen ITZR Technology Co., Ltd., is a specialist in theresearch, production and sale of a wide variety of motherboards for laptops, desktop, industrial, and all-in-one PCs as well as mobiles and tablets. We also have significant experience in OEM assembly of 10”, 13”, and 14”laptops for many customers worldwide.<br />\n </p>\n\n<p>We are by reputation, one of the leading manufacturers of motherboards and laptops in China. We invest heavily in the latest equipment as well as training for our workforce whether assembly or management. We have large scale production capacity and utilising the latest production planning techniques can ensure that we meet with your needs.<br />\n </p>\n\n<p>Because of our excellent design, high build quality and competitive prices, we are rapidly expanding our sales in Europe, America, Southeast Asia and the Middle East. We will work hard to help you meet your objectives and look forward to making new friends worldwide..</p>\n');
