(6, 14, NULL, NULL, NULL, NULL, NULL, '<p>Видеокарта ASUS GeForce GTX 750 Ti – это выбор тех потребителей, которые желают оборудовать свой компьютер по-настоящему высокопроизводительными комплектующими. Представленная модель станет максимально рациональным приобретением для установки в игровом компьютере. Это объясняется тем, что она обладает всеми необходимыми характеристиками для успешного воспроизведения современных игр. Хорошо продуманный дизайн ASUS GeForce GTX 750 Ti предусматривает присутствие системы активного охлаждения, которая позаботится о том, чтобы видеокарта стабильно работала даже в условиях полной загрузки.</p>\r\n', NULL),
