(973, 14, NULL, NULL, NULL, NULL, NULL, '<p>NVIDIA® GeForce® 9600 GT GPU предлагает мощные захватывающие развлекательные возможности для экстремальных игр и видео высокой четкости. Играйте в новейшие игры DirectX® 10 с невероятно высокой скоростью и смотрите новинки в сфере HD DVD и Blu-ray с блистательно чистым изображением. С поддержкой технологий нового поколения GeForce и PureVideo® HD графический процессор GeForce 9600 GT станет для вас ключом к необъятной мощи.</p>\r\n', NULL),
