(962, 12, NULL, NULL, NULL, NULL, NULL, NULL, '2.0'),
(962, 14, NULL, NULL, NULL, NULL, NULL, '<p>NVIDIA® GeForce® GTS 450 предлагает беспрецедентное соотношение цены/производительности и является идеальным решением для работы по сети LAN. Благодаря двукратному приросту производительности при обработке геометрии при помощи DirectX 11 графический процессор GeForce GTS 450 оставляет позади всех конкурентов и дарит пользователям потрясающий реализм в последних игровых новинках DirectX 11, таких как <em>Civilization V</em>*. Поддержка ведущих в области технологий, включая NVIDIA® 3D Vision™, NVIDIA® PhysX, высокопроизводительные драйверы NVIDIA GeForce и многие другие, в GeForce GTS 450 обеспечивает невероятное наслаждение графикой.</p>\r\n\r\n<ul>\r\n	<li>частота ядра/памяти: 783/3608 МГц</li>\r\n	<li>поддержка режима SLI/CrossFire</li>\r\n	<li>разъемы DVI x2, HDMI, VGA</li>\r\n	<li>поддержка DirectX 11, OpenGL 4.1</li>\r\n	<li>работа с 2 мониторами</li>\r\n</ul>\r\n', NULL),
(962, 11, NULL, 450, NULL, NULL, NULL, NULL, NULL),
