(963, 9, NULL, 448, NULL, NULL, NULL, NULL, NULL),
(963, 12, NULL, NULL, NULL, NULL, NULL, NULL, '2.0'),
(963, 14, NULL, NULL, NULL, NULL, NULL, '<p>Погрузитесь в мир игровых ощущений так глубоко, как никогда ранее, с новым поколением графических процессоров NVIDIA® GeForce® GTX 260. С графическими процессорами NVIDIA GeForce GTX 200 продуктивность и погружение становятся абсолютными.<br />\r\n<br />\r\nНасладитесь игровыми мирами в высоком качестве, реалистичными персонажами и настолько могущественными силами природы, что ваши ладони станут влажными от напряжения, а сердце будет биться все быстрее с каждым новым кадром. Помимо игр вы можете смотреть Blu-ray фильмы и кодировать видео до 7 раз быстрее, чем с помощью традиционного CPU<sup>1</sup>.</p>\r\n', NULL),
