(964, 14, NULL, NULL, NULL, NULL, NULL, '<p>Ускорь производительность своего ПК до 5 раз с самым современным дискретным графическим решением NVIDIA GeForce GT 640<sup>1</sup>. Редактируй свои фото и видео и играй в последние игры с поддержкой DirectX 11 и технологии NVIDIA® PhysX® для наиболее реалистичных игровых ощущений. Перенеси формат 3D на свой ПК с технологией NVIDIA® 3D Vision™ и поддержкой более 650 3D игр.</p>\r\n', NULL),
