(1208, 12, NULL, NULL, NULL, NULL, NULL, NULL, '3.0'),
(1208, 14, NULL, NULL, NULL, NULL, NULL, '<p>Напряженный игровой процесс, приложения и HD-видео безупречны, как никогда прежде, с революционной видеокартой AMD Radeon™ HD 7800 серии для настольных ПК.</p>\r\n\r\n<ul>\r\n	<li>Поддержка Microsoft Windows® 8 и DirectX® 11.2</li>\r\n	<li>Благодаря архитектуре GCN производительность поднимается на невиданный уровень, а качество видео становится выше всяких похвал</li>\r\n	<li>Полное погружение в мир игр с многоэкранной технологией AMD Eyefinity<sup>1</sup></li>\r\n</ul>\r\n', NULL),
