(1209, 12, NULL, NULL, NULL, NULL, NULL, NULL, '2.0'),
(1209, 14, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Работает на NVIDIA GeForce GTX 560 Ti GPU</li>\r\n	<li>Интеграция с лучшей памятью 256-битным интерфейсом памяти 1 Гб GDDR5 отрасли</li>\r\n	<li>Особенности Dual Link DVI-I * 2 / мини-HDMI с защитой HDCP</li>\r\n	<li>OC Edition</li>\r\n	<li>GIGABYTE WINDFORCE 2X Параллель-наклонена анти-turblence дизайн охлаждения</li>\r\n	<li>GIGABYTE UDV материал</li>\r\n	<li>Поддержка технологии NVIDIA® SLI ™</li>\r\n	<li>Поддержка NVIDIA® 3D Vision ™</li>\r\n	<li>Поддержка технологии NVIDIA® CUDA ™</li>\r\n	<li>Поддержка NVIDIA® PhyX ™ Technology</li>\r\n	<li>* Минимальная 500W или больше питания системы с двумя 6-контактными разъемами для внешнего источника питания</li>\r\n</ul>\r\n', NULL),
