(1210, 14, NULL, NULL, NULL, NULL, NULL, '<p>Видеокарта NVIDIA® GeForce® GTX 560 дарит производительность и мощь, необходимые вам для игры в разрешении full HD 1080p. Подарите себе игровой реализм с оживающими играми благодаря технологиям DirectX11, PhsyX и NVIDIA® 3D Vision™.</p>\r\n', NULL),
