(1211, 14, NULL, NULL, NULL, NULL, NULL, '<p>Удивительно, высокой четкости игровой опыт</p>\r\n\r\n<p>Ультра-захватывающий реализм и выдающуюся производительность для требовательных геймеров<br />\r\nПогрузитесь в AMD Eyefinity technology1<br />\r\nВторое поколение DirectX® 11-совместимых графических<br />\r\nПерегружать свои приложения с помощью AMD App Acceleration</p>\r\n', NULL),
