(1212, 14, NULL, NULL, NULL, NULL, NULL, '<p>Ultra Durable VGA серии GIGABYTE</p>\r\n\r\n<p>Работает на AMD Radeon HD 6870 GPU<br />\r\nИнтеграция с памятью 1GB GDDR5, интерфейс памяти 256-бит<br />\r\nОсобенности Dual-Link DVI-I / DVI-D / HDMI / Mini DisplayPort * 2<br />\r\nРазогнан до 915 МГц<br />\r\nПоддержка CrossFireX ™, Avivo ™ HD, Eyefinity и EyeSpeed<br />\r\nТребования к системе питания: 500W</p>\r\n', NULL),
(1212, 11, NULL, 500, NULL, NULL, NULL, NULL, NULL),
