(1213, 9, NULL, 128, NULL, NULL, NULL, NULL, NULL),
(1213, 12, NULL, NULL, NULL, NULL, NULL, NULL, '3.0'),
(1213, 14, NULL, NULL, NULL, NULL, NULL, '<p>Высокопроизводительная видеокарта GIGABYTE GeForce GTX 650 GV-N650OC-1GI покажет хорошие результаты при отображении динамичных визуальных эффектов в компьютерных играх, во время обработки фотографий и видео. Высокую мощность гарантирует видеочип GeForce GTX 650 от nVidia и 1 Гб GDDR5-видеопамяти с частотой работы 5000 МГц. Активная система охлаждения прекрасно справляется со своей работой, обеспечивая стабильную рабочую температуру.</p>\r\n\r\n<p>Технология CUDA позволяет полностью использовать все визуальные возможности видеокарты GIGABYTE GeForce GTX 650 GV-N650OC-1GI. Технология nVidia SLI дает возможность увеличивать общую производительность графической системы, объединив в работе несколько видеокарт. Поддержка технологии nVidia 3D Vision позволит ощутить все преимущества современного объемного изображения. Для подключения 4 мониторов доступны разъемы DVI, HDMI и VGA.</p>\r\n', NULL),
(1213, 11, NULL, 500, NULL, NULL, NULL, NULL, NULL),
(1213, 13, NULL, NULL, NULL, NULL, NULL, NULL, '6 pin'),
