(1214, 8, 1, NULL, NULL, NULL, NULL, NULL, NULL),
(1214, 9, NULL, 128, NULL, NULL, NULL, NULL, NULL),
(1214, 12, NULL, NULL, NULL, NULL, NULL, NULL, '2.1'),
(1214, 14, NULL, NULL, NULL, NULL, NULL, '<h5>Технология AMD Eyefinity: Gaming и производительность на срок до трех одновременных дисплеев</h5>\r\n\r\n<ul>\r\n	<li>Расширьте свои любимые игры на нескольких мониторах с технологией AMD Eyefinity для невероятно экспансивной поле зрения.</li>\r\n	<li>Получить свободу и гибкость для обновления. Это модульное решение позволяет добавлять дополнительные дисплеи, когда вы нуждаетесь в них.</li>\r\n	<li>Делайте больше. Положите вашу производительность в овердрайв и пусть несколько дисплеев возлагать всю необходимую информацию прямо перед вашими глазами.</li>\r\n	<li>Не выбирать между игрой и работой. Пусть несколько дисплеев поможет вам наслаждаться играми, фильмами и веб-страниц одновременно.</li>\r\n</ul>\r\n', NULL),
