(1217, 14, NULL, NULL, NULL, NULL, NULL, '<p>Графпроцессор Radeon HD6670 обладает 480 шейдерными конвейерами, 24 текстурными конвейерами, 8 блоками растеризации по цвету и 32 блоками растеризации по глубине, а тактовая частота равна 800МГц. Карта комплектуется 1Гбайт памяти типа GDDR5 SDRAM со 128-битной шириной шины и тактовой частотой 4000МГц эффективных. Теоретическая расчётная мощность карты составляет 768 GFLOPS одинарной точности.</p>\r\n', NULL),
