(1218, 14, NULL, NULL, NULL, NULL, NULL, '<p>Новая серия SAPPHIRE HD 7700 представляет собой новое семейство графических карт, ориентированных на энтузиастов на бюджете и основных пользователей, которые ищут для повышения производительности графики. Он основан на втором семействе GPU от AMD построен в новом процессе 28nm и с изображением высоко оценен GCN архитектуры обработки графики. Новые графические процессоры HD 7770 и HD 7750 имеют оптимизированную внутреннюю структуру обмена многие из особенностей высокопроизводительных HD 7900 серии уже отпущены, но с меньшим количеством потоковых процессоров и упрощенная 128-битный высокоскоростной интерфейс памяти к новейшим типам DDR5 памяти.</p>\r\n', NULL),
