(1321, 14, NULL, NULL, NULL, NULL, NULL, '<p>Модель: ASUS HD7970-DC2T-3GD5<br />\r\nПоддерживаемые API: DirectX 11.1, OpenGL 4.2<br />\r\nПоддержка фирменных технологий: NVIDIA GPU Boost, NVIDIA TXAA technology, NVIDIA FXAA technology, NVIDIA Adaptive Vertical Sync, NVIDIA Surround technology, NVIDIA PhysX technology, NVIDIA 3D Vision, 3-way NVIDIA SLI, NVIDIA CUDA, PCI Express 3.0<br />\r\nЧастота ядра: 1000 МГц<br />\r\nЧастота памяти: 5600 MHz ( 1400 MHz GDDR5 )<br />\r\nМаксимальное разрешение: D-Sub Max Resolution - 2048x1536, DVI Max Resolution - 2560x1600<br />\r\nВыходы:     DVI-D, DVI-I, HDMI, 4хDisplayPort<br />\r\nРекомендуемая мощность блока питания, Вт: 500</p>\r\n\r\n<p>• Частота графического процессора увеличена до 1000 МГц;<br />\r\n• Система охлаждения DirectCU II с шестью тепловыми трубками охлаждает эффективнее и при меньшем уровне шума, чем референсный кулер;<br />\r\n• 12-фазная цифровая система питания DIGI+;<br />\r\n• Функция VGA Hotwire облегчает мониторинг и изменение напряжений питания видеокарты;<br />\r\n• Эксклюзивная утилита GPU Tweak для мониторинга и настройки параметров видеокарты;<br />\r\n• Поддержка до 6 мониторов одновременно (AMD Eyefinity).</p>\r\n', NULL),
