(1382, 14, NULL, NULL, NULL, NULL, NULL, '<p>- Поддержка процессоров Intel<sup>®</sup> Core™ i7 / i5 / i3 и Pentium<sup>®</sup> G6950 для Socket LGA1156<br />\r\n- Поддержка технологии Intel<sup>®</sup> Turbo Boost<br />\r\n- Двухканальная память DDR3<br />\r\n- 2 x DDR3 DIMM<br />\r\n- Поддержка DDR3 2600+(OC)/2133(OC)/1866(OC)/1600/1333/1066 non-ECC, не буферизованная<br />\r\n- Максимальный объем памяти: 8 Гб*<br />\r\n- 1 x PCI Express 2.0 x16 (в режиме x16)<br />\r\n- 1 x PCI Express 2.0 x1 (2.5ГТ/с)<br />\r\n- 2 x PCI<br />\r\n- 4 x SATA2 3.0 Гб/с, с поддержкой функций NCQ, AHCI и Hot Plug<br />\r\n- 1 x PS/2 для клавиатуры<br />\r\n- 1 x VGA/D-Sub<br />\r\n- 1 x VGA/DVI-D<br />\r\n- 6 x USB 2.0<br />\r\n </p>\r\n', NULL),
