(1060, 14, NULL, NULL, NULL, NULL, NULL, '<p>- Поддержка процессоров Intel<sup>®</sup> Core™ i7/i5/i3/Xeon<sup>®</sup>/Pentium<sup>®</sup>/Celeron<sup>®</sup> 4-го и нового 4-го поколения (сокет 1150)<br />\r\n- Двухканальная память DDR3/DDR3L<br />\r\n- 4 x DDR3/DDR3L DIMM<br />\r\n- Поддержка DDR3/DDR3L 1600/1333/1066 non-ECC, не буферизованная<br />\r\n- Максимальный объем памяти: 32 Гб*<br />\r\n- Поддержка Intel<sup>®</sup> Extreme Memory Profile (XMP) 1.3 / 1.2<br />\r\n- Поддержка встроенных возможностей Встроенная графика Intel<sup>®</sup> HD Graphics: Intel<sup>®</sup> Quick Sync Video с AVC, MVC (S3D) и MPEG-2 Full HW Encode1, Intel<sup>®</sup> InTru 3D, технологию Intel<sup>®</sup> Clear Video HD, Intel<sup>®</sup> Insider, Встроенная графика Intel<sup>®</sup> HD Graphics 4400/4600<br />\r\n- Pixel Shader 5.0, DirectX 11.1<br />\r\n- Максимальное количество памяти 512 МБ*<br />\r\n- Три устройства графического вывода данных: D-Sub, DVI-D и HDMI<br />\r\n- Поддержка трех мониторов<br />\r\n- Поддержка HDMI с максимальным разрешением до 1920x1200 @60Гц<br />\r\n- Поддержка DVI-D с максимальным разрешением до 1920x1200 @60Гц<br />\r\n- Поддержка D-sub с максимальным разрешением до 1920x1200 @60Гц<br />\r\n- Поддержка Auto Lip Sync, Deep Color (12bpc), xvYCC и HBR (High Bit Rate Audio) через HDMI (необходим совместимый HDMI-монитор)<br />\r\n- Поддержка функции HDCP через DVI-D и HDMI<br />\r\n- Воспроизведение видео Full HD 1080p Blu-ray (BD) через порты DVI-D и HDMI<br />\r\n </p>\r\n\r\n<table border=\"\">\r\n	<tbody>\r\n		<tr>\r\n			<td>- 7.1-канальный HD-кодек с поддержкой защиты данных (Аудиокодек Realtek ALC892)<br />\r\n			- Поддержка Premium Blu-ray audio<br />\r\n			- Gigabit LAN 10/100/1000 Мб/с<br />\r\n			- 1 x PCI Express 3.0 x16 (PCIE2: в режиме x16)<br />\r\n			- 3 x PCI Express 2.0 x1<br />\r\n			- 2 x PCI<br />\r\n			- 6 x SATA3 6.0 Гб/с, с поддержкой функций RAID (RAID 0, RAID 1, RAID 5, RAID 10, Технология Intel<sup>®</sup> Rapid Storage 12 и Intel<sup>®</sup> Smart Response), NCQ, AHCI и Hot Plug<br />\r\n			- 1 x разъем Power со светодиодом<br />\r\n			- 2 x Разъем для подключения вентиляторов процессора (1 x 4-pin, 1 x 3-pin)<br />\r\n			- 2 x Разъем для подключения вентиляторов корпуса (2 x 4-pin)<br />\r\n			- 1 x Разъем для подключения вентиляторов Power (3-pin)<br />\r\n			- 1 x 24-контактный разъем питания ATX<br />\r\n			- 1 x 8-контактный разъем питания 12 В<br />\r\n			- 1 x Вывод аудио на переднюю панель корпуса<br />\r\n			- 1 x SPDIF Out<br />\r\n			- 2 x USB 2.0 (поддержка до четырех USB 2.0)<br />\r\n			- 1 x USB 3.0 (поддержка до двух USB 3.0)<br />\r\n			Панель ввода/вывода<br />\r\n			- 1 x PS/2 порт для клавиатуры и мышки<br />\r\n			- 1 x D-Sub<br />\r\n			- 1 x DVI-D<br />\r\n			- 1 x HDMI<br />\r\n			- 2 x USB 2.0<br />\r\n			- 4 x USB 3.0<br />\r\n			- 1 x RJ-45 LAN с индикаторами (ACT/LINK LED и SPEED LED)<br />\r\n			- Разъемы HD-аудио: Боковые динамики / Задние динамики / Центр / Сабвуфер / Линейный вход / Передние динамики / Микрофон</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL),
