(1384, 14, NULL, NULL, NULL, NULL, NULL, '<p>- LGA 775 for Intel<sup>®</sup> Core™ 2 Extreme / Core™ 2 Quad / Core™ 2 Duo / Pentium<sup>®</sup> Dual Core / Celeron<sup>®</sup> Dual Core / Celeron, supporting Penryn Quad Core Yorkfield and Dual Core Wolfdale processors<br />\r\n<br />\r\n </p>\r\n\r\n<table border=\"\">\r\n	<tbody>\r\n		<tr>\r\n			<td>- Dual Channel DDR3/DDR2 memory technology*<br />\r\n			- 2 x DDR3 DIMM slots<br />\r\n			- Supports DDR3 1600(OC)/1333/1066/800 non-ECC, un-buffered memory<br />\r\n			- Max. capacity of system memory: 8GB**<br />\r\n			- 2 x DDR2 DIMM slots<br />\r\n			- Supports DDR2 1200(OC)/1066/800/667 non-ECC, un-buffered memory<br />\r\n			- Max. capacity of system memory: 8GB**<br />\r\n			<br />\r\n			- 7.1 CH HD Audio (VIA<sup>®</sup> VT1718S Audio Codec)<br />\r\n			<br />\r\n			- PCIE x1 Gigabit LAN 10/100/1000 Mb/s<br />\r\n			- Realtek RTL8111DL<br />\r\n			 \r\n			<table border=\"\">\r\n				<tbody>\r\n					<tr>\r\n						<td>- 1 x PCI Express 2.0 x16 slot (blue @ x16 mode)<br />\r\n						- 1 x PCI Express x1 slot<br />\r\n						- 2 x PCI slots<br />\r\n						 \r\n						<table border=\"\">\r\n							<tbody>\r\n								<tr>\r\n									<td>- 6 x SATA2 3.0 Gb/s connectors, support NCQ, AHCI and Hot Plug functions<br />\r\n									- 1 x ATA133 IDE connector (supports 2 x IDE devices)<br />\r\n									- 1 x Floppy connector<br />\r\n									- 1 x IR header<br />\r\n									- 1 x Print port header<br />\r\n									- 1 x COM port header<br />\r\n									- 1 x HDMI_SPDIF header<br />\r\n									- CPU/Chassis/Power FAN connector<br />\r\n									- 24 pin ATX power connector<br />\r\n									- 4 pin 12V power connector<br />\r\n									- CD in header<br />\r\n									- Front panel audio connector<br />\r\n									- 2 x USB 2.0 headers (support 4 USB 2.0 ports)<br />\r\n									<br />\r\n									- 1 x PS/2 Mouse Port<br />\r\n									- 1 x PS/2 Keyboard Port<br />\r\n									- 1 x Coaxial SPDIF Out Port<br />\r\n									- 1 x Optical SPDIF Out Port<br />\r\n									- 6 x Ready-to-Use USB 2.0 Ports<br />\r\n									- 1 x RJ-45 LAN Port with LED (ACT/LINK LED and SPEED LED)<br />\r\n									- HD Audio Jack: Side Speaker / Rear Speaker / Central / Bass / Line in / Front Speaker / Microphone<br />\r\n									<br />\r\n									- Micro ATX Form Factor: 9.6-in x 8.3-in, 24.4 cm x 21.1 cm</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL),
