(1397, 14, NULL, NULL, NULL, NULL, NULL, '<p>AMD® Socket AM2/AM2+ for AMD Phenom™ FX / Phenom / Athlon™ / Sempron™<br />\r\n<br />\r\n2 x DIMM, max. 4GB, DDR2 1066 / 800 / 667, ECC,non-ECC, un-buffered memory<br />\r\nDual channel memory architecture<br />\r\n<br />\r\n1 x PCIe x16<br />\r\n1 x PCIe x1<br />\r\n1 x PCI<br />\r\n<br />\r\nIntegrated Programmable Shader model3.0 DirectX 9 graphics processor<br />\r\nMaximum shared memory of 256 MB<br />\r\nSupports RGB with max. resolution 1920 x1440 (@75Mhz*32bpp)<br />\r\n<br />\r\n10 x USB 2.0 ports (6 ports at mid-board, 4 ports at back panel)<br />\r\n<br />\r\nRTL8201CP Phy 100/10M<br />\r\n<br />\r\n1 x PS/2 Keyboard port<br />\r\n1 x Mouse port<br />\r\n1 x RJ45 port<br />\r\n1 x VGA<br />\r\n1x COM<br />\r\n4 x USB 2.0/1.1<br />\r\n6-Channel Audio I/O<br />\r\n<br />\r\n3 x USB connector (6 ports)<br />\r\n2 x SATA connectors<br />\r\n1 x CPU Fan connector<br />\r\n1 x Front panel audio connector<br />\r\n1 x IDE connector<br />\r\n1 x Internal speaker connector<br />\r\n1 x CD audio in connector<br />\r\n1 x 24-pin EATX Power connector<br />\r\n1 x 4-pin ATX +12V Power connector<br />\r\n1 x System Panel connector<br />\r\n<br />\r\nmATX Form Factor, 9.6”x 8.0”</p>\r\n', NULL),
