(1248, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживаемые процессоры<br />\r\nIntel Core i7/Core i5/Core i3/Pentium/Celeron</p>\r\n\r\n<p>Память: DDR4 DIMM, 2133 МГц<br />\r\nКоличество слотов памяти: 2<br />\r\n- Поддержка двухканального режима<br />\r\nМаксимальный объем памяти: 32 Гб<br />\r\n<br />\r\nКоличество разъемов SATA 6Gb/s: 4</p>\r\n\r\n<p>Слоты расширения: 1xPCI-E x16, 2xPCI-E x1, 3xPCI</p>\r\n\r\n<p>Звук: 7.1CH, HDA, на основе Realtek ALC887</p>\r\n\r\n<p>Ethernet: 1000 Мбит/с, на основе Realtek RTL8111H</p>\r\n\r\n<p>Наличие интерфейсов:<br />\r\n10 USB, из них 4 USB 3.0 (2 на задней панели), выход S/PDIF, 1xCOM, D-Sub, DVI, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n\r\n<p>Разъемы на задней панели:<br />\r\n4 USB, из них 2 USB 3.0, D-Sub, DVI, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n\r\n<p>Основной разъем питания:24-pin<br />\r\nРазъем питания процессора: 4-pin</p>\r\n', NULL),
