(1398, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживаемые процессоры:<br />\r\nAMD Athlon 64 X2/Athlon 64 FX/Athlon 64/Sempron<br />\r\n<br />\r\nПамять: DDR2 DIMM, 533-800 МГц<br />\r\nКоличество слотов памяти: 4<br />\r\nМаксимальный объем памяти: 4 Гб<br />\r\nПоддержка двухканального режима</p>\r\n\r\n<p>Дисковые контроллеры<br />\r\nIDE - количество слотов: 1, UltraDMA 133<br />\r\nSATA - количество разъемов SATA 3Gb/s: 4, RAID: 0, 1, 5, 10, JBOD</p>\r\n\r\n<p>Звук: 5.1CH, HDA, на основе ADI AD1986A<br />\r\nВстроенный видеоадаптер: на основе NVIDIA GeForce 6100</p>\r\n\r\n<p>Ethernet: 1000 Мбит/с, на основе NVIDIA MCP61P</p>\r\n\r\n<p>Наличие интерфейсов<br />\r\n10 USB, выход S/PDIF, 1xCOM, D-Sub, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n\r\n<p>Разъемы на задней панели<br />\r\n4 USB, 1xCOM, D-Sub, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n\r\n<p>Основной разъем питания: 24-pin<br />\r\nРазъем питания процессора: 4-pin</p>\r\n', NULL),
