(1063, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживаемые процессоры<br />\r\nIntel Celeron D/Core 2 Duo/Core 2 Extreme/Core 2 Quad/Pentium 4/Pentium D/Pentium Extreme</p>\r\n\r\n<p>Память: DDR2 DIMM, 667-1066 МГц<br />\r\nКоличество слотов памяти: 4<br />\r\nМаксимальный объем памяти: 8 Гб<br />\r\nПоддержка двухканального режима</p>\r\n\r\n<p>Дисковые контроллеры<br />\r\nIDE<br />\r\nколичество слотов: 1, UltraDMA 133, RAID: нет<br />\r\nSATA<br />\r\nколичество разъемов SATA 3Gb/s: 5, RAID: 0, 1, JBOD</p>\r\n\r\n<p>Слоты расширения<br />\r\n2 x PCI-E x16 (Синий работает в режиме x16, черный в режиме x4 или x1) Поддержка CrossFire <br />\r\n1 x PCI-E x1 <br />\r\n3 x PCI </p>\r\n\r\n<p>Звук<br />\r\n7.1CH, HDA, на основе Realtek ALC 883</p>\r\n\r\n<p>Сеть<br />\r\n1000 Мбит/с</p>\r\n\r\n<p>Наличие интерфейсов<br />\r\n12 USB, 2xFireWire (IEEE1394a), выход S/PDIF, 1xCOM, 1xeSATA, Ethernet, PS/2 (клавиатура)</p>\r\n\r\n<p>Разъемы на задней панели<br />\r\n6 USB, 1xFireWire (IEEE1394a), коаксиальный выход, 1xeSATA, Ethernet, PS/2 (клавиатура)</p>\r\n\r\n<p>Основной разъем питания: 24-pin</p>\r\n\r\n<p>Разъем питания процессора: 4-pin</p>\r\n', NULL),
