(1064, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддержка процессоров:<br />\r\nIntel® Core™ 2 Extreme/ Intel® Core™ 2 Quad/ Intel® Core™ 2 Duo/ Intel Pentium Extreme Edition/ Intel® Pentium D/ Intel® Pentium 4 Extreme Edition/ Intel® Pentium 4/ Intel® Celeron</p>\r\n\r\n<p>Двухканальная архитектура памяти<br />\r\n2 x 1.8V DDR2 DIMM с максимальной памятью до 4 Гб<br />\r\nDDR2 1066(OC)/800/667</p>\r\n\r\n<p>1 х PCI Express x16<br />\r\n3 x PCI Express x1<br />\r\n3 разъема для PCI-плат расширений</p>\r\n\r\n<p>Разъемы на плате:</p>\r\n\r\n<ol>\r\n	<li>1 x FDD</li>\r\n	<li>2 разъема USB 2.0/1.1</li>\r\n	<li>1 x CD in</li>\r\n	<li>24-контактный ATX разъем</li>\r\n	<li>Выход SPDIF-интерфейса</li>\r\n	<li>Разъем для вентилятора CPU</li>\r\n	<li>Разъем для системного вентилятора</li>\r\n	<li>Разъем для передней панели</li>\r\n	<li>1 разъем для power LED</li>\r\n	<li>1 IDE разъем</li>\r\n	<li>1 x chassis intrusion разъем</li>\r\n	<li>1 аудио разъем</li>\r\n	<li>4 SATA разъема 3 Гбит/с</li>\r\n	<li>4-контактный разъем ATX 12 В</li>\r\n</ol>\r\n\r\n<p>Разъемы на задней панели:</p>\r\n\r\n<ol>\r\n	<li>1 COM-порт</li>\r\n	<li>1 LAN-розетка RJ45</li>\r\n	<li>1 x LPT</li>\r\n	<li>PS/2 Клавиатура/Мышь</li>\r\n	<li>3 аудио разъема (Вход/Выход/Микрофон)</li>\r\n	<li>4 USB-порта 2.0/1.1</li>\r\n</ol>\r\n\r\n<p> </p>\r\n', NULL),
