(1876, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживаемые процессоры<br />\r\nIntel Core i7/Core i5/Core i3/Pentium/Celeron</p>\r\n\r\n<p>Память<br />\r\nDDR3 DIMM, 1066-1333 МГц<br />\r\nКоличество слотов памяти<br />\r\n4<br />\r\nПоддержка двухканального режима<br />\r\nесть<br />\r\nМаксимальный объем памяти<br />\r\n16 Гб</p>\r\n\r\n<p>Дисковые контроллеры<br />\r\nIDE<br />\r\nнет<br />\r\nSATA<br />\r\nколичество разъемов SATA 3Gb/s: 4</p>\r\n\r\n<p>Слоты расширения<br />\r\n2xPCI-E x16, 1xPCI<br />\r\nПоддержка PCI Express 2.0<br />\r\nесть<br />\r\nПоддержка PCI Express 3.0<br />\r\nесть</p>\r\n\r\n<p>Звук<br />\r\n7.1CH, HDA, на основе Realtek ALC887</p>\r\n\r\n<p>Сеть<br />\r\nEthernet<br />\r\n1000 Мбит/с, на основе Realtek 8111E</p>\r\n\r\n<p>Подключение<br />\r\nНаличие интерфейсов<br />\r\n10 USB, 1xCOM, D-Sub, DVI, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT<br />\r\nРазъемы на задней панели<br />\r\n4 USB, D-Sub, DVI, Ethernet, PS/2 (клавиатура), PS/2 (мышь)<br />\r\nОсновной разъем питания<br />\r\n24-pin<br />\r\nРазъем питания процессора<br />\r\n4-pin<br />\r\nТип системы охлаждения<br />\r\nпассивное</p>\r\n', NULL),
