(1911, 14, NULL, NULL, NULL, NULL, NULL, '<p>ASRock Super Alloy<br />\r\nПоддержка процессоров Intel® Core™ 6-го поколения (Разъем 1151)<br />\r\nПоддержка DDR4 2133<br />\r\n1 PCIe 3.0 x16, 1 PCIe 2.0 x1<br />\r\nУстройство графического вывода данных: DVI-D<br />\r\n7.1-канальный HD-кодек (Аудиокодек Realtek ALC887), Аудио-конденсаторы ELNA<br />\r\n4 SATA3<br />\r\n4 USB 3.0 (2 передних, 2 задних)<br />\r\nПоддерживает Full Spike Protection, ASRock Live Update & APP Shop</p>\r\n', NULL),
