(1873, 14, NULL, NULL, NULL, NULL, NULL, '<p><br />\r\nAMD Socket AM2 Athlon64/Athlon64 FX/Athlon64 X2/Sempron Processors <br />\r\nAMD Cool \'n\' Quiet™ Technology<br />\r\nAMD 64 architecture enables simultaneous 32-bit and 64-bit computing <br />\r\nAMD Live!™ Ready</p>\r\n\r\n<p>Память<br />\r\n4 x DIMM, Max. 8 GB, DDR2 800/667/533 ECC,Non-ECC,Un-buffered Memory <br />\r\nDual Channel memory architecture<br />\r\n*When installing total memory of 4GB capacity or more, Windows 32-bit operation system may only recognize less than 3GB. Hence, a total installed memory of less than 3GB is recommended</p>\r\n\r\n<p>Слоты расширения<br />\r\n1 x PCIe x16 slot <br />\r\n2 x PCIe x1 <br />\r\n3 x PCI 2.2 </p>\r\n\r\n<p>Хранение данных<br />\r\n1 xUltraDMA 133/100/66/33 <br />\r\n4 xSATA 3 Gb/s ports NVIDIA MediaShield™ RAID <br />\r\nSupport RAID 0,1,0+1,5,JBOD </p>\r\n\r\n<p>Подключения на плате<br />\r\n3 x USB connectors support additional 6 USB 2.0 ports <br />\r\n1 x Floppy disk drive connector <br />\r\n1 x IDE connector <br />\r\n4 x SATA connectors <br />\r\n1 x CPU Fan connector <br />\r\n1 x Chassis Fan connector <br />\r\n1 x Power Fan connector <br />\r\n1 x S/PDIF Out connector <br />\r\n1 x4-pin ATX 12V Power connector <br />\r\n24 Power connector <br />\r\nFront panel audio connector<br />\r\nCOM connector<br />\r\nChassis Intrusion connector<br />\r\nCD/AUX audio in<br />\r\nSystem Panel </p>\r\n\r\n<p>Подключения на задней стороне<br />\r\n1 x Parallel <br />\r\n1 x PS/2 Keyboard <br />\r\n1 x PS/2 Mouse <br />\r\n1 x S/PDIF Out <br />\r\n1 x LAN(RJ45) port <br />\r\n4 x USB 2.0/1.1 <br />\r\n6 -Channel Audio I/O </p>\r\n', NULL),
