(1853, 14, NULL, NULL, NULL, NULL, NULL, '<p>Процессоры<br />\r\nAMD AM3+ FX™/Phenom™ II/Athlon™ II/Sempron™ 100 Series Processors <br />\r\nAMD Cool \'n\' Quiet™ Technology</p>\r\n\r\n<p>Оперативная память<br />\r\n4 x DIMM, Max. 16GB, DDR3 2000(O.C.)/1866(O.C.)/1800(O.C.)/1600(O.C.)/1333/1066 MHz ECC, Non-ECC Memory<br />\r\nDual Channel Memory Architecture<br />\r\n*Refer to www.asus.com or this user manual for the Memory QVL (Qualified Vendors Lidts).<br />\r\n*Due to OS limitation, when installing total memory of 4GB capacity or more, Windows® 32-bit operation system may only recognize less than 3GB. Install a 64-bit WindowsWindows® OS when you want to install 4GB or more memory on the motherboard.<br />\r\n* AMD AM3 100 and 200 series CPU support up to DDR3 1066MHz.</p>\r\n\r\n<p>Слоты расширения<br />\r\n1 x PCIe 2.0 x16 <br />\r\n2 x PCIe 2.0 x1 <br />\r\n3 x PCI</p>\r\n\r\n<p>Хранилище данных<br />\r\nBuilt-in Controller : <br />\r\n1 x UltraDMA 133/100/66 for up to 2 PATA devices , navy blue<br />\r\nBuilt-in Controller : <br />\r\n6 x SATA 3Gb/s port(s), (Blue)<br />\r\nSupport Raid 0, 1, 10, JBOD</p>\r\n\r\n<p>Локальная сеть<br />\r\nRealtek 8111E , 1 x Gigabit LAN Controller(s)</p>\r\n\r\n<p>Аудио<br />\r\nRealtek® ALC887 8-Channel High Definition Audio CODEC</p>\r\n\r\n<p>Разъемы на задней панели<br />\r\n1 x PS/2 keyboard (purple)<br />\r\n1 x PS/2 mouse (green)<br />\r\n1 x LAN (RJ45) port(s)<br />\r\n2 x USB 3.0 <br />\r\n2 x USB 2.0 <br />\r\n1 x COM port(s)<br />\r\n1 x Parallel port(s)<br />\r\n3 x Audio jack(s)</p>\r\n\r\n<p>Разъeмы на плате<br />\r\n3 x USB 2.0 connector(s) support(s) additional 6 USB 2.0 port(s)<br />\r\n1 x IDE connector(s)<br />\r\n6 x SATA 3Gb/s connector(s)<br />\r\n1 x CPU Fan connector(s) <br />\r\n1 x Chassis Fan connector(s) <br />\r\n1 x S/PDIF out header(s)<br />\r\n1 x 24-pin EATX Power connector(s)<br />\r\n1 x 4-pin ATX 12V Power connector(s)<br />\r\n1 x Front panel audio connector(s) (AAFP)<br />\r\n1 x System panel(s)</p>\r\n\r\n<p>Форм-фактор<br />\r\nATX Form Factor <br />\r\n12 inch x 8.5 inch ( 30.5 cm x 21.6 cm )</p>\r\n', NULL),
