(1904, 14, NULL, NULL, NULL, NULL, NULL, '<p>Процессор<br />\r\nSocket<br />\r\nLGA775<br />\r\nПоддерживаемые процессоры<br />\r\nIntel Celeron D/Pentium 4<br />\r\nСистемная шина<br />\r\n533 МГц - 800 МГц<br />\r\nПоддержка Hyper-Threading<br />\r\nесть</p>\r\n\r\n<p>Память</p>\r\n\r\n<p>Память<br />\r\nDDR/DDR2 DIMM, 333-600 МГц<br />\r\nКоличество слотов памяти<br />\r\n6<br />\r\nПоддержка двухканального режима<br />\r\nесть<br />\r\nМаксимальный объем памяти<br />\r\n4 Гб</p>\r\n\r\n<p>Дисковые контроллеры<br />\r\nIDE<br />\r\nколичество слотов: 1, UltraDMA 100, RAID: нет<br />\r\nSATA<br />\r\nколичество разъемов SATA 1.5Gb/s: 4, , RAID: 0, 1 на основе Intel ICH6R</p>\r\n\r\n<p>Слоты расширения<br />\r\n1xPCI-E x16, 2xPCI-E x1, 3xPCI</p>\r\n\r\n<p>Звук<br />\r\n7.1CH, HDA, на основе C-Media CMI9880</p>\r\n\r\n<p>Ethernet<br />\r\n1000 Мбит/с, на основе Marvell 88E8053</p>\r\n\r\n<p>Наличие интерфейсов<br />\r\n8 USB, выход S/PDIF, 1xCOM, GAME/MIDI, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT<br />\r\nРазъемы на задней панели<br />\r\n4 USB, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n\r\n<p>Дополнительная информация<br />\r\nПитание 24 pin ATX + 4 pin 12V разъемы питания. Функции BIOS: Plug and Play, DMI 2.0, WfM 2.0, SMBIOS 2.3.; поддержка памяти - 2 x 240-pin DIMM слота до 2Гб DDR2 600/533/400 или 4 x 184-pin DIMM слота до 4Гб DDR 400/333</p>\r\n', NULL),
