(1791, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживаемые процессоры<br />\r\nIntel Core 2 Duo/Pentium D/Pentium 4/Celeron D</p>\r\n\r\n<p>Память<br />\r\nDDR2 DIMM, 533 МГц<br />\r\nКоличество слотов памяти<br />\r\n2<br />\r\nПоддержка двухканального режима<br />\r\nесть<br />\r\nМаксимальный объем памяти<br />\r\n2 Гб</p>\r\n\r\n<p>Дисковые контроллеры<br />\r\nIDE<br />\r\nколичество слотов: 1, UltraDMA 100<br />\r\nSATA<br />\r\nколичество разъемов SATA 3Gb/s: 4</p>\r\n\r\n<p>Слоты расширения<br />\r\n1xPCI-E x16, 2xPCI-E x1, 3xPCI</p>\r\n\r\n<p>Звук<br />\r\n7.1CH, HDA, на основе Realtek ALC888</p>\r\n\r\n<p>Ethernet<br />\r\n1000 Мбит/с, на основе Realtek RTL8111B</p>\r\n\r\n<p>Наличие интерфейсов<br />\r\n8 USB, 1xCOM, GAME/MIDI, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n', NULL),
