(1760, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживает 2-е и 3-е поколение Intel® Core™ i7 / i5 / i3 / Xeon® / Pentium® / Celeron® LGA1155</p>\r\n\r\n<p>Память<br />\r\n- Двухканальная память DDR3<br />\r\n- 4 x DDR3 DIMM<br />\r\n- Поддержка DDR3 2800+(OC)/2400(OC)/2133(OC)/1866(OC)/1600/1333/1066 non-ECC, не буферизованная<br />\r\n- Максимальный объем памяти: 32 Гб*<br />\r\n- Поддержка Intel® Extreme Memory Profile (XMP) 1.3 / 1.2</p>\r\n\r\n<p>Графическое ядро<br />\r\n- Поддержка встроенных возможностей Встроенная графика Intel® HD Graphics: Intel® Quick Sync Video 2.0, Intel® InTru™ 3D, технологию Intel® Clear Video HD, Intel® Insider™, Встроенная графика Intel® HD Graphics 2500/4000 с процессорами Intel® Ivy Bridge<br />\r\n- Поддержка встроенных возможностей Встроенная графика Intel® HD Graphics: Intel® Quick Sync Video, Intel® InTru™ 3D, технологию Intel® Clear Video HD, Встроенная графика Intel® HD Graphics 2000/3000, Intel® Advanced Vector Extensions (AVX) с процессорами Intel® Sandy Bridge<br />\r\n- Pixel Shader 5.0, DirectX 11 с процессорами Intel® Ivy Bridge. Pixel Shader 4.1, DirectX 10.1 с процессорами Intel® Sandy Bridge<br />\r\n- Максимальное количество памяти 1760 МБ с процессорами Intel® Ivy Bridge. Максимальное количество памяти 1759 МБ с процессорами Intel® Sandy Bridge<br />\r\n- Три устройства графического вывода данных: D-Sub, DVI-D и HDMI<br />\r\n- Поддержка HDMI с максимальным разрешением до 1920x1200 @60Гц<br />\r\n- Поддержка DVI с максимальным разрешением до 1920x1200 @60Гц<br />\r\n- Поддержка D-sub с максимальным разрешением до 2048x1536 @75Гц<br />\r\n- Поддержка Auto Lip Sync, Deep Color (12bpc), xvYCC и HBR (High Bit Rate Audio) через HDMI (необходим совместимый HDMI-монитор)<br />\r\n- Поддержка функции HDCP через DVI и HDMI<br />\r\n- Поддержка воспроизведения Full HD 1080p Blu-ray (BD) / HD-DVD через порты DVI и HDMI</p>\r\n\r\n<p>Аудио<br />\r\n- 7.1-канальный HD-кодек с поддержкой защиты данных (Аудиокодек Realtek ALC892)<br />\r\n- Поддержка Premium Blu-ray audio</p>\r\n\r\n<p>Разъемы<br />\r\n- 1 x PCI Express 3.0 x16 (PCIE1: в режиме x16)<br />\r\n- 1 x PCI Express 2.0 x16 (PCIE3: в режиме x4)<br />\r\n- 1 x PCI Express 2.0 x1<br />\r\n- 2 x PCI<br />\r\n- Поддержка AMD Quad CrossFireX™ и CrossFireX™</p>\r\n\r\n<p>Sata<br />\r\n- 2 x SATA3 6.0 Гб/с, с поддержкой функций RAID (RAID 0, RAID 1, RAID 5, RAID 10, Intel® Rapid Storage и Intel® Smart Response), NCQ, AHCI и Hot Plug</p>\r\n\r\n<p>USB<br />\r\n- 2 x задние разъема USB 3.0, обеспечиваемых чипом Intel® Z77, с поддержкой USB 1.0/2.0/3.0 и пропускной способностью до 5 Гбит/с<br />\r\n- 2 x задние разъема USB 3.0, обеспечиваемых чипом Etron EJ168A, с поддержкой USB 1.0/2.0/3.0 и пропускной способностью до 5 Гбит/с<br />\r\n- 1 x фронтальный разъема USB 3.0, обеспечиваемых чипом Intel® Z77 (поддержка до двух USB 3.0), с поддержкой USB 1.0/2.0/3.0 и пропускной способностью до 5 Гбит/с</p>\r\n\r\n<p>Коннекторы<br />\r\n- 4 x SATA2 3.0 Гб/с, с поддержкой функций RAID (RAID 0, RAID 1, RAID 5, RAID 10, Intel® Rapid Storage и Intel® Smart Response), NCQ, AHCI и Hot Plug (SATA2_3 разделяется с eSATA2)<br />\r\n- 2 x SATA3 6.0 Гб/с<br />\r\n- 1 x IR<br />\r\n- 1 x COM<br />\r\n- 1 x HDMI_SPDIF<br />\r\n- 1 x разъем Power со светодиодом<br />\r\n- 2 x Разъем для подключения вентиляторов процессора (1 x 4-pin, 1 x 3-pin)<br />\r\n- 2 x Разъем для подключения вентиляторов корпуса (1 x 4-pin, 1 x 3-pin)<br />\r\n- 1 x Разъем для подключения вентиляторов Power (3-pin)<br />\r\n- 24-контактный разъем питания ATX<br />\r\n- 8-контактный разъем питания 12 В<br />\r\n- Вывод аудио на переднюю панель корпуса<br />\r\n- 3 x USB 2.0 (поддержка до шести USB 2.0)<br />\r\n- 1 x USB 3.0 (поддержка до двух USB 3.0)<br />\r\n- 1 x Dr. Debug со светодиодом*<br />\r\n- 1 x кнопка Power Switch со светодиодом<br />\r\n- 1 x кнопка Reset Switch со светодиодом<br />\r\n- 1 x кнопка Clear CMOS со светодиодом</p>\r\n\r\n<p>Задняя панель- 1 x PS/2 для клавиатуры<br />\r\n- 1 x D-Sub<br />\r\n- 1 x DVI-D<br />\r\n- 1 x HDMI<br />\r\n- 1 x Optical SPDIF Out<br />\r\n- 3 x USB 2.0<br />\r\n- 1 x Fatal1ty разъём для мышки (USB 2.0)<br />\r\n- 1 x eSATA2<br />\r\n- 4 x USB 3.0<br />\r\n- 1 x RJ-45 LAN с индикаторами (ACT/LINK LED и SPEED LED)<br />\r\n- 1 x кнопка Clear CMOS со светодиодом<br />\r\n- Разъемы HD-аудио: Задние динамики / Центр / Сабвуфер / Линейный вход / Передние динамики / Микрофон</p>\r\n\r\n<p>ОС<br />\r\n- Совместимость с Microsoft Windows® 8.1 32-bit / 8.1 64-bit / 8 32-bit / 8 64-bit / 7 32-bit / 7 64-bit / Vista™ 32-bit / Vista™ 64-bit / XP 32-bit / XP 64-bit<br />\r\n    </p>\r\n', NULL),
