(1767, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживаемые процессоры<br />\r\nIntel Core i7/Core i5/Core i3</p>\r\n\r\n<p>Память<br />\r\nDDR3 DIMM, 1066-1333 МГц<br />\r\nКоличество слотов памяти<br />\r\n2<br />\r\nПоддержка двухканального режима<br />\r\nесть<br />\r\nМаксимальный объем памяти<br />\r\n16 Гб</p>\r\n\r\n<p>Дисковые контроллеры<br />\r\nIDE<br />\r\nнет<br />\r\nSATA<br />\r\nколичество разъемов SATA 3Gb/s: 4</p>\r\n\r\n<p>Слоты расширения<br />\r\n1xPCI-E x16, 2xPCI-E x1, 3xPCI<br />\r\nПоддержка PCI Express 2.0<br />\r\nесть</p>\r\n\r\n<p>Звук<br />\r\n7.1CH, HDA, на основе Realtek ALC887</p>\r\n\r\n<p>Ethernet<br />\r\n1000 Мбит/с, на основе Realtek 8111E</p>\r\n\r\n<p>Наличие интерфейсов<br />\r\n10 USB, из них 2 USB 3.0 (2 на задней панели), выход S/PDIF, 1xCOM, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n\r\n<p>Разъемы на задней панели<br />\r\n4 USB, из них 2 USB 3.0, 1xCOM, Ethernet, PS/2 (клавиатура), PS/2 (мышь), LPT</p>\r\n', NULL),
