(1774, 14, NULL, NULL, NULL, NULL, NULL, '<p>Intel® Socket 1155 for 2nd Generation Core™ i7/Core™ i5/Core™ i3 Processors </p>\r\n\r\n<p>2 x DIMM, Max. 16GB, DDR3 1333/1066 MHz Non-ECC, Un-buffered Memory</p>\r\n\r\n<p>1 x PCIe 2.0 x16 <br />\r\n3 x PCIe 2.0 x1</p>\r\n\r\n<p>4 x SATA 3Gb/s port(s), (Blue)</p>\r\n\r\n<p>Realtek 8111E , 1 x Gigabit LAN Controller(s)</p>\r\n\r\n<p>Realtek® ALC887 8-Channel High Definition Audio CODEC</p>\r\n\r\n<p>Разъемы на задней панели<br />\r\n1 x PS/2 keyboard (purple)<br />\r\n1 x PS/2 mouse (green)<br />\r\n1 x D-Sub<br />\r\n1 x LAN (RJ45) port(s)<br />\r\n4 x USB 2.0 <br />\r\n1 x COM port(s)<br />\r\n1 x Parallel port(s)<br />\r\n3 x Audio jack(s)</p>\r\n\r\n<p>Разъeмы на плате<br />\r\n3 x USB 2.0 connector(s) support(s) additional 6 USB 2.0 port(s)<br />\r\n4 x SATA 3Gb/s connector(s)<br />\r\n1 x CPU Fan connector(s) <br />\r\n1 x Chassis Fan connector(s) <br />\r\n1 x S/PDIF out header(s)<br />\r\n1 x 24-pin EATX Power connector(s)<br />\r\n1 x 4-pin ATX 12V Power connector(s)<br />\r\n1 x Front panel audio connector(s) (AAFP)<br />\r\n1 x Internal speaker connector(s)<br />\r\n1 x System panel(s)</p>\r\n', NULL),
