(1775, 14, NULL, NULL, NULL, NULL, NULL, '<p>Процессор<br />\r\nIntel® Socket 1155 for 2nd Generation Processors </p>\r\n\r\n<p>Оперативная память<br />\r\n2 x DIMM, Max. 16GB, DDR3 1333/1066 MHz Non-ECC, Un-buffered Memory </p>\r\n\r\n<p>Слоты расширения<br />\r\n1 x PCIe 2.0 x16 <br />\r\n1 x PCIe 2.0 x1 <br />\r\n1 x PCIe 2.0 x4</p>\r\n\r\n<p>Хранилище данных<br />\r\n4 x SATA 3Gb/s port(s), (Blue)</p>\r\n\r\n<p>Локальная сеть<br />\r\nRealtek 8111E , 1 x Gigabit LAN Controller(s)</p>\r\n\r\n<p>Аудио<br />\r\nVIA VT1708S 8-Channel High Definition Audio CODEC</p>\r\n\r\n<p>Порты USB<br />\r\n10 x USB 2.0 port(s) (6 at back panel, (Black), 4 at mid-board)</p>\r\n\r\n<p>Разъемы на задней панели<br />\r\n1 x PS/2 keyboard/mouse combo port(s)<br />\r\n1 x DVI-D<br />\r\n1 x D-Sub<br />\r\n1 x LAN (RJ45) port(s)<br />\r\n6 x USB 2.0 <br />\r\n3 x Audio jack(s)</p>\r\n\r\n<p>Разъeмы на плате<br />\r\n2 x USB 2.0 connector(s) support(s) additional 4 USB 2.0 port(s)<br />\r\n4 x SATA 3Gb/s connector(s)<br />\r\n1 x CPU Fan connector(s) <br />\r\n1 x Chassis Fan connector(s) <br />\r\n1 x S/PDIF out header(s)<br />\r\n1 x 24-pin EATX Power connector(s)<br />\r\n1 x 4-pin ATX 12V Power connector(s)<br />\r\n1 x Front panel connector(s) <br />\r\n1 x Front panel audio connector(s) (AAFP)<br />\r\n1 x Internal speaker connector(s)</p>\r\n', NULL),
