(1771, 14, NULL, NULL, NULL, NULL, NULL, '<p>Поддерживаемые процессоры<br />\r\nIntel Core i7/i5/i3</p>\r\n\r\n<p>Память<br />\r\nDDR3 DIMM, 1066-1333 МГц<br />\r\nКоличество слотов памяти<br />\r\n2<br />\r\nПоддержка двухканального режима<br />\r\nесть<br />\r\nМаксимальный объем памяти<br />\r\n16 Гб</p>\r\n\r\n<p>Дисковые контроллеры<br />\r\nIDE<br />\r\nнет<br />\r\nSATA<br />\r\nколичество разъемов SATA 3Gb/s: 4, количество разъемов SATA 6Gb/s: 2</p>\r\n\r\n<p>Слоты расширения<br />\r\n1xPCI-E x16, 1xPCI-E x4, 2xPCI<br />\r\nПоддержка PCI Express 2.0<br />\r\nесть</p>\r\n\r\n<p>Звук<br />\r\n7.1CH, HDA, на основе Realtek ALC887</p>\r\n\r\n<p>Ethernet<br />\r\n1000 Мбит/с, на основе Realtek RTL8112L</p>\r\n\r\n<p>Наличие интерфейсов<br />\r\n14 USB, 1xCOM, D-Sub, DVI, Ethernet, PS/2 (мышь), LPT<br />\r\nРазъемы на задней панели<br />\r\n6 USB, D-Sub, DVI, Ethernet, PS/2 (мышь)</p>\r\n', NULL),
