(1568, 14, NULL, NULL, NULL, NULL, NULL, '<p>Сокет LGA775 для новейших процессоров Intel® Core™ 2 Duo / Pentium® Dual Core/ Pentium® D / Pentium® 4 / Celeron 4xx series/ Celeron® D</p>\r\n\r\n<p>Графика<br />\r\nВстроенный Intel Graphics Media Accelerator 950 ( GMA950 )<br />\r\nМаксимальная динамическая видео память до 224Мб (Системная память больше или приравнивается к 512Мб)</p>\r\n\r\n<p>память<br />\r\nдвухканальная DDR2 память architecture<br />\r\n2 x 240-пиновая DDR DIMM до 2 ГБ<br />\r\nDDR2 667/533/400 DDR2 SDRAM</p>\r\n\r\n<p>Слот расширения<br />\r\n1 x PCI Express x16 разъем<br />\r\n2 x PCI разъема</p>\r\n\r\n<p>Накопитель<br />\r\nПоддерживается Intel®ICH7<br />\r\n2 x Ultra DMA100/66 устройств<br />\r\n4 x Serial ATAII устройства</p>\r\n\r\n<p>Аудио    <br />\r\nIDT 92HD202 шестиканальный аудио кодек для высококачественного звука</p>\r\n\r\n<p>Локальная сеть    <br />\r\nRealtek RTL8100C 10/100 Мб/с Fast Ethernet контроллер</p>\r\n\r\n<p>Порты на задней панели    <br />\r\n1 x PS/2 клавиатура & PS/2 мышь разъемы<br />\r\n4 x USB порта<br />\r\n1 x VGA порт<br />\r\n1 x Последовательный порт (COM1)<br />\r\n1 x RJ45 LAN разъем<br />\r\n1 x Аудио порт (3 audio разъема)</p>\r\n\r\n<p>Внутренние разъемы    <br />\r\n1 x 24-пиновый ATX Power Supply разъем<br />\r\n1 x 4-пиновый ATX 12V разъем<br />\r\nРазъем под накопитель на фиксированном диске<br />\r\n4 x SATA<br />\r\n1 x IDE разъем<br />\r\n1 x SPDIF out разъем<br />\r\n1 паралельная выводная плата<br />\r\n2 x USB 2.0 разъема Поддержка Дополнительный 4 USB портов<br />\r\n1 x Clear CMOS устройство<br />\r\n1 x Передняя панель<br />\r\n1 x Front panel аудио разъем<br />\r\nCD в разъем<br />\r\nпроцессорFAN/SYSFAN разъемы</p>\r\n', NULL),
