(1792, 14, NULL, NULL, NULL, NULL, NULL, '<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:90%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>CPU</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>Socket 478 for latest Intel Pentium 4 / Celeron processor</li>\r\n				<li>FSB 800/ 533/ 400MHz</li>\r\n				<li>Supports Hyper-Threading Technology CPU</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>CHIPSET</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>Intel<sup>®</sup> 848P & ICH5</li>\r\n				<li>North Bridge: Intel<sup>®</sup> 848P</li>\r\n				<li>South Bridge: Intel<sup>®</sup> ICH5</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>MEMORY</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>2 x 184-pin DDR DIMM socket support up to 2 GB</li>\r\n				<li>Support DDR400/333/266 DDR SDRAM</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>EXPANSION SLOT</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>1 x AGP 8X/4X slot</li>\r\n				<li>5 x PCI slots</li>\r\n				<li>1 x CNR slot</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>STORAGE</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>Support by Intel<sup>®</sup> ICH5\r\n				<ul>\r\n					<li>4 x Ultra DMA100/66 devices</li>\r\n					<li>2 x Serial ATA devices</li>\r\n				</ul>\r\n				</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>AUDIO</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>Realtek ALC655 6-Channel audio CODEC</li>\r\n				<li>Compliant with AC\'97 2.3 specification</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>LAN</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>Realtek RTL8100C 10/100 Mbps Fast Ethernet Controller</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>REAR PANEL I/O</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>1 x PS/2 keyboard & PS/2 mouse connectors</li>\r\n				<li>4 x USB ports</li>\r\n				<li>1 x RJ45 LAN connector</li>\r\n				<li>1 x Parallel port (LPT)</li>\r\n				<li>1 x Serial port (COM1)</li>\r\n				<li>1 x Audio port (Line-in, Line-out, Mic-in)</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>INTERNAL I/O CONNECTORS & HEADERS</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>1 x 20-pin ATX Power Supply Connector & 4-pin 12V Connector</li>\r\n				<li>1 x FDD connector supports one 360K~2.88MB FDD</li>\r\n				<li>2 x IDE connectors</li>\r\n				<li>2 x Serial ATA connectors</li>\r\n				<li>2 x USB 2.0 headers support additional 4 USB 2.0 Ports</li>\r\n				<li>1 x SPDIF out header</li>\r\n				<li>1 x Speaker header</li>\r\n				<li>1 x Front panel switch/LED header</li>\r\n				<li>1 x Front panel audio header</li>\r\n				<li>CD in/ AUX in headers</li>\r\n				<li>CPUFAN/PWRFAN/SYSFAN connectors</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>SYSTEM BIOS</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>Award BIOS with 2Mb Flash ROM</li>\r\n				<li>Supports Plug and Play 1.0A, APM 1.2, Multi Boot, DMI</li>\r\n				<li>Supports ACPI revision 1.0 specification</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>FORM FACTOR</strong></td>\r\n			<td>\r\n			<ul>\r\n				<li>ATX Size, 305mm*200mm</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL),
