(1800, 14, NULL, NULL, NULL, NULL, NULL, '<h2>Подробные характеристики</h2>\r\n\r\n<h2>Процессор</h2>\r\n\r\n<p>Socket</p>\r\n\r\n<p>AM3</p>\r\n\r\n<p>Поддерживаемые процессоры</p>\r\n\r\n<p>AMD Phenom II/Athlon II</p>\r\n\r\n<p>Системная шина</p>\r\n\r\n<p>HyperTransport</p>\r\n\r\n<p>Поддержка многоядерных процессоров</p>\r\n\r\n<p>есть</p>\r\n\r\n<h2>Чипсет</h2>\r\n\r\n<p>Чипсет</p>\r\n\r\n<p>AMD 760G</p>\r\n\r\n<p>BIOS</p>\r\n\r\n<p>Award c возможностью аварийного восстановления</p>\r\n\r\n<p>Поддержка SLI/CrossFire</p>\r\n\r\n<p>Hybrid CrossFireX</p>\r\n\r\n<h2>Память</h2>\r\n\r\n<p>Память</p>\r\n\r\n<p>DDR3 DIMM, 800-1333 МГц</p>\r\n\r\n<p>Количество слотов памяти</p>\r\n\r\n<p>2</p>\r\n\r\n<p>Поддержка двухканального режима</p>\r\n\r\n<p>есть</p>\r\n\r\n<p>Максимальный объем памяти</p>\r\n\r\n<p>8 Гб</p>\r\n\r\n<h2>Дисковые контроллеры</h2>\r\n\r\n<p>IDE</p>\r\n\r\n<p>нет</p>\r\n\r\n<p>SATA</p>\r\n\r\n<p>количество разъемов SATA 3Gb/s: 6, RAID: 0, 1, 10, JBOD на основе AMD SB710</p>\r\n\r\n<h2>Слоты расширения</h2>\r\n\r\n<p>Слоты расширения</p>\r\n\r\n<p>1xPCI-E x16, 1xPCI-E x1, 1xPCI</p>\r\n\r\n<p>Поддержка PCI Express 2.0</p>\r\n\r\n<p>есть</p>\r\n\r\n<h2>Аудио/видео</h2>\r\n\r\n<p>Звук</p>\r\n\r\n<p>7.1CH, HDA</p>\r\n\r\n<p>Встроенный видеоадаптер</p>\r\n\r\n<p>есть, на основе ATI Radeon HD3000</p>\r\n\r\n<h2>Сеть</h2>\r\n\r\n<p>Ethernet</p>\r\n\r\n<p>1000 Мбит/с</p>\r\n\r\n<h2>Подключение</h2>\r\n\r\n<p>Наличие интерфейсов</p>\r\n\r\n<p>8 USB, 1xCOM, D-Sub, DVI, Ethernet, PS/2 (клавиатура), PS/2 (мышь)</p>\r\n\r\n<p>Разъемы на задней панели</p>\r\n\r\n<p>4 USB, D-Sub, DVI, Ethernet, PS/2 (клавиатура), PS/2 (мышь)</p>\r\n\r\n<p>Основной разъем питания</p>\r\n\r\n<p>24-pin</p>\r\n\r\n<p>Разъем питания процессора</p>\r\n\r\n<p>4-pin</p>\r\n\r\n<h2>Дополнительные параметры</h2>\r\n\r\n<p>Форм-фактор</p>\r\n\r\n<p>microATX</p>\r\n', NULL),
