(1034, 14, NULL, NULL, NULL, NULL, NULL, '<p>Особенности блока питания<br />\r\nОплетка шлейфов, Защита от повышения напряжения (OVP), Защита от перегрузки любого из выходов блока по отдельности (OCP), Защита от понижения напряжения (UVP), Защита от скачков тока и напряжения (SIP)</p>\r\n\r\n<p>Наличие PFC<br />\r\nБлок питания с активным PFC (Power Factor Correction) модулем</p>\r\n\r\n<p>Максимальная нагрузка    <br />\r\n+3.3V - 20A, +5V - 20A, +12V -50A, +5VSB - 2.5A, -12V - 0.3A; Комбинированная нагрузка: +3.3V & +5V - 120 Вт</p>\r\n\r\n<p>Частота    <br />\r\n50 Гц</p>\r\n\r\n<p>Размеры (ширина x высота x глубина)    <br />\r\n150 x 86 x 149 мм</p>\r\n\r\n<p>Управление скоростью вращения    <br />\r\nОт термодатчика</p>\r\n\r\n<p>Охлаждение блока питания    <br />\r\n1 вентилятор: 140 x 140 мм (на нижней стенке)</p>\r\n\r\n<p>Уровень шума    <br />\r\n20.1 ~ 34.5 дБ</p>\r\n\r\n<p>Входное напряжение    <br />\r\n200 ~ 240 В </p>\r\n\r\n<p>КПД    <br />\r\n85%</p>\r\n\r\n<p>ATX 12V v.2.3</p>\r\n\r\n<p>Коннектор питания мат.платы<br />\r\n24+8 pin, 24+4 pin, 20+4 pin (разборный 24-pin коннектор. 4-pin могут отстегиваться в случае необходимости, разборный 8-pin коннектор)</p>\r\n\r\n<p>Коннектор питания видеокарт<br />\r\n2x 6/8-pin разъема</p>\r\n\r\n<p>Разъемы для подключения MOLEX/FDD/SATA<br />\r\n4/1/6</p>\r\n\r\n<p>MTBF<br />\r\n120 тыс. часов</p>\r\n', NULL),
