(1369, 14, NULL, NULL, NULL, NULL, NULL, '<p>Мощность<br />\r\n430 Вт<br />\r\nСистема охлаждения<br />\r\n1 вентилятор (80 мм)<br />\r\nРазъемы</p>\r\n\r\n<p>Тип разъема для материнской платы<br />\r\n20+4 pin<br />\r\nКоличество разъемов 4-pin CPU<br />\r\n1<br />\r\nКоличество разъемов 15-pin SATA<br />\r\n1<br />\r\nКоличество разъемов 4-pin IDE<br />\r\n9<br />\r\nКоличество разъемов 4-pin Floppy<br />\r\n2<br />\r\nСила тока</p>\r\n\r\n<p>Ток по линии +3.3 В<br />\r\n28 A<br />\r\nТок по линии +5 В<br />\r\n30 A<br />\r\nТок по линии +12 В 1<br />\r\n18 A<br />\r\nТок по линии -12 В<br />\r\n0.8 A<br />\r\nТок по линии +5 В Standby<br />\r\n2 A<br />\r\nДополнительная информация</p>\r\n\r\n<p>Цвет<br />\r\nсерый<br />\r\nРазмеры (ВxШxГ)<br />\r\n86x140x150 мм</p>\r\n', NULL),
