(1825, 14, NULL, NULL, NULL, NULL, NULL, '<p>Общие характеристики</p>\r\n\r\n<p>Назначение<br />\r\nдля процессора<br />\r\nSocket<br />\r\nLGA775, LGA1150/1151/1155/S1156, LGA1356/S1366, AM2, AM2+, AM3/AM3+/FM1, S754, S939<br />\r\nСовместимость<br />\r\nIntel Core i7 / Core i5 / Core i3 / Core 2 Extreme / Core 2 Quad / Core 2 Duo / Pentium D / Pentium 4 / Pentium / Celeron D / Celeron / AMD Phenom II X4 / Phenom II X3 / Phenom / Athlon 64 FX / Athlon 64 X2 / Athlon 64 / Sempron<br />\r\nКоличество тепловых трубок<br />\r\n3<br />\r\nМатериал радиатора<br />\r\nалюминий+медь<br />\r\nКоличество вентиляторов<br />\r\n1<br />\r\nРазмеры вентилятора (ДхШхВ)<br />\r\n80x80x85 мм<br />\r\nСкорость вращения<br />\r\n1000 - 1600 об/мин<br />\r\nУровень шума<br />\r\n19 - 28 дБ<br />\r\nДополнительно</p>\r\n\r\n<p>Тип коннектора<br />\r\n3-pin<br />\r\nЦвет подсветки<br />\r\nкрасный<br />\r\nРегулятор оборотов<br />\r\nвнутренний<br />\r\nВремя безотказной работы<br />\r\n50000 ч<br />\r\nРазмеры кулера (ШхВxГ)<br />\r\n120x159x120 мм<br />\r\nВес<br />\r\n495 г</p>\r\n', NULL),
(1190, 14, NULL, NULL, NULL, NULL, NULL, '<p>Область применения: Специализированное средство на водной основе предназначено для ухода за экранами обычных и LCD мониторов.<br />\r\nСвойства: <br />\r\n• Легко удаляет большинство загрязнений <br />\r\n• Активно снимает электростатический заряд, препятствуя быстрому накоплению грязи и пыли<br />\r\n• Не оставляет разводов<br />\r\n• Экологически безопасно<br />\r\n• Экономично в применении<br />\r\n• Не содержит спирта и растворителей. <br />\r\nСостав: Вода очищенная, четвертичная соль аммония, консервант.<br />\r\nСПОСОБ ПРИМЕНЕНИЯ: Распылить небольшое количество средства на хорошо впитывающую влагу ткань или специальную салфетку и очистить поверхность.<br />\r\nМаксимальный эффект достигается в сочетании с «Универсальными» салфетками «PARITY»</p>\r\n', NULL),
(1930, 14, NULL, NULL, NULL, NULL, NULL, '<p>Количество оборудования, подключаемого к системным блокам, мобильным персональным компьютерам и прочих устройств, являющихся хостом USB, все увеличивается. В связи с этим возрастает и популярность смежных аксессуаров. К примеру, кабель удлинитель USB 2.0 AM/AF часто используется для того, чтобы получить возможность размещать технику на комфортном расстоянии. Он обеспечивает достаточно высокие скоростные показатели (до 480 Мбит данных в секунду) и гарантирует сохранение качества сигнала. Среди прочих особенностей стоит отметить наличие 1,8 метра длины и литых разъемов.</p>\r\n', NULL),
(1507, 14, NULL, NULL, NULL, NULL, NULL, '<p>Общие характеристики</p>\r\n\r\n<p>Тип    Wi-Fi точка доступа<br />\r\nСтандарт беспроводной связи    802.11n, частота 2.4 ГГц<br />\r\nПоддержка MIMO    есть<br />\r\nМакс. скорость беспроводного соединения    300 Мбит/с<br />\r\nПрием/передача</p>\r\n\r\n<p>Защита информации    WEP, WPA, WPA2, 802.1x<br />\r\nМощность передатчика    20 dBM<br />\r\nОпции точки доступа/моста</p>\r\n\r\n<p>Коммутатор    4xLAN<br />\r\nСкорость портов    100 Мбит/сек<br />\r\nМаршрутизатор</p>\r\n\r\n<p>Маршрутизатор    есть<br />\r\nМежсетевой экран (FireWall)    есть<br />\r\nNAT    есть<br />\r\nSPI    есть<br />\r\nDHCP-сервер    есть<br />\r\nПоддержка Dynamic DNS    есть<br />\r\nДемилитаризованная зона (DMZ)    есть<br />\r\nСтатическая маршрутизация    есть<br />\r\nVPN</p>\r\n\r\n<p>Поддержка VPN pass through    есть<br />\r\nАнтенна</p>\r\n\r\n<p>Количество внешних антенн    2 x 5 dBi<br />\r\nТип внешней антенны    несъемная<br />\r\nМониторинг и конфигурирование</p>\r\n\r\n<p>Web-интерфейс    есть<br />\r\nДополнительно</p>\r\n\r\n<p>Флэш-память    есть<br />\r\nРазмеры (ШxВxГ)    200x28x140 мм</p>\r\n', NULL),
(1276, 14, NULL, NULL, NULL, NULL, NULL, '<p>Стильная акустическая система для ноутбука.<br />\r\nПитание от порта USB<br />\r\nКолонки не требуют сетевого источника питания. Просто подключите колонки к USB-разъему компьютера и наслаждайтесь звуком. Колонки необходимо подключить также к аудиоразъему вашего персонального компьютера, поскольку данная модель не оборудована интегрированной звуковой картой.<br />\r\nКомпактные размеры<br />\r\nАкустическая система займет минимум места на рабочем столе<br />\r\nРегулятор громкости звука<br />\r\nВам не придется переключаться на управление вашим плеером, чтобы увеличить или уменьшить звук. Регулируйте громкость одним движением.</p>\r\n\r\n<p>Технические характеристики</p>\r\n\r\n<p>Суммарная выходная мощность (RMS)    4 Вт<br />\r\nМощность сателлитов (RMS)    2x2 Вт<br />\r\nРазмер динамика сателлита    2.5 \"<br />\r\nДиапазон частот    200–18 000 Гц<br />\r\nТип интерфейса    3,5-мм джек<br />\r\nРегуляторы    Общая громкость<br />\r\nПитание    От USB, 5 В<br />\r\nРазмеры без упаковки    7.0 x 7.0 x 14.4 см<br />\r\nРазмеры индивидуальной упаковки    9.5 x 8.0 x 16.0 см<br />\r\nМасса индивидуальной упаковки    0.35 кг<br />\r\nROHS / CE    Нет</p>\r\n', NULL),
(918, 14, NULL, NULL, NULL, NULL, NULL, '<p>Основные характеристики<br />\r\nПроизводитель    Creative<br />\r\nМодель    Inspire 2.1 G-380<br />\r\nТип оборудования    Акустическая система 2.1<br />\r\nЧастотный диапазон    40 Гц - 20 кГц</p>\r\n\r\n<p>Аудио<br />\r\nСуммарная выходная мощность    29 Ватт<br />\r\nПитание    От электросети<br />\r\nБлок питания    Внешний<br />\r\nПотребительские свойства<br />\r\nМагнитное экранирование    Есть</p>\r\n', NULL),
(1285, 14, NULL, NULL, NULL, NULL, NULL, '<p>Компьютерные колонки Genius SW-2.1 355 сочетают в себе высокое качество исполнения и оптимальную цену. Система может подключаться к компьютерам, ноутбукам, MP3-, CD-плеерам, а также другим проигрывающим устройствам. Управление системой простое и удобное - кнопки громкости и тембра вынесены прямо на корпус сателлита. В модели Genius SW-2.1 355 предусмотрена возможность отдельно настраивать нижние частоты. В комплект системы входит 2 широкополосные колонки и активный сабвуфер, сконструированный по типу фазоинверторного оформления звука. Выход фазоинвертора расположен на передней панели сабвуфера. Компактная акустика легко разместится на рабочем столе.</p>\r\n\r\n<p> </p>\r\n\r\n<p><br />\r\nОбщие параметры<br />\r\nФормат акустической системы    2.1<br />\r\nАкустические характеристики<br />\r\nОбщая выходная мощность    10 Вт<br />\r\nМинимальная воспроизводимая частота    20 Гц<br />\r\nМаксимальная воспроизводимая частота    20000 Гц<br />\r\nФункции и управление<br />\r\nРегулировка низких частот (басов)    есть<br />\r\nРегулировка высоких частот    нет<br />\r\nРазъемы и интерфейсы<br />\r\nАналоговые входы/выходы    линейный вход (стерео)</p>\r\n', NULL),
