(4143, 14, NULL, NULL, NULL, NULL, NULL, '<h1><span style=\"font-size:12px\">220х180х0.4 мм</span></h1>\r\n\r\n<p>Клейкая основа</p>\r\n\r\n<p>Коврик не скользит по поверхности стола.</p>\r\n\r\n<p>Прочный материал</p>\r\n\r\n<p>Устойчив к механическому воздействию.</p>\r\n\r\n<p>Ультратонкий коврик</p>\r\n\r\n<p>Разработан специально для оптических и лазерных мышей.</p>\r\n\r\n<p>Мерцающая структура поверхности - запатентованная разработка</p>\r\n\r\n<p>Обеспечивает четкое позиционирование луча оптических и большинства видов лазерных мышей.</p>\r\n', NULL),
(4167, 30, NULL, NULL, NULL, NULL, NULL, NULL, 'новый'),
(4168, 30, NULL, NULL, NULL, NULL, NULL, NULL, 'новый'),
(4147, 14, NULL, NULL, NULL, NULL, NULL, '<p>Компактный геймерский коврик для мыши из высококачественной вспененной резины 3мм с плотным тканевым покрытием. Он хорошо прилегает к столу, приятен на ощупь и обеспечивает отличную управляемость мышки при любой чувствительности. Уровень сопротивления – низкий. Размер 220*180 мм. Оптимальный размер для столов с ограниченным свободным пространством.</p>\r\n', NULL),
(4147, 30, NULL, NULL, NULL, NULL, NULL, NULL, 'новый'),
(4148, 14, NULL, NULL, NULL, NULL, NULL, '<p>Компактный коврик для мыши из высококачественной вспененной резины 4мм с плотным тканевым покрытием. Он хорошо прилегает к столу, приятен на ощупь и обеспечивает отличную управляемость мышки при любой чувствительности. Уровень сопротивления – низкий. Размер 220*180 мм. Оптимальный размер для столов с сильно ограниченным свободным пространством. Чёрный цвет основы очень практичен в использовании.</p>\r\n', NULL),
(4148, 30, NULL, NULL, NULL, NULL, NULL, NULL, 'новый'),
(4145, 14, NULL, NULL, NULL, NULL, NULL, '<p>Ультратонкий коврик изготовлены из прочного материала</p>\r\n\r\n<p>Клейкая основа</p>\r\n\r\n<p>Позволяет многократно фиксировать коврик в любом удобном месте рабочей поверхности.</p>\r\n', NULL),
(4145, 30, NULL, NULL, NULL, NULL, NULL, NULL, 'новый'),
(4146, 14, NULL, NULL, NULL, NULL, NULL, '<p>Ультратонкий коврик эргономичной формы</p>\r\n\r\n<p>Предназначены для комфортной работы с большинством видов мышей.</p>\r\n\r\n<p>Основа из искусственной кожи</p>\r\n\r\n<p>Препятствует скольжению коврика по рабочей поверхности.</p>\r\n', NULL),
(4146, 30, NULL, NULL, NULL, NULL, NULL, NULL, 'новый'),
(4144, 14, NULL, NULL, NULL, NULL, NULL, '<p>Тематические принты</p>\r\n\r\n<p>Математические формулы, неправильные глаголы, меры объема и веса и множество других \"шпаргалок\" по разным предметам всегда будут под рукой.</p>\r\n\r\n<p>Сверхпрочные материалы</p>\r\n\r\n<p>Позволяют коврикам долго сохранять свой внешний вид.</p>\r\n\r\n<p>Клейкая основа</p>\r\n\r\n<p>Позволяет многократно фиксировать коврик в любом удобном месте рабочей поверхности.</p>\r\n', NULL),
