(4123, 14, NULL, NULL, NULL, NULL, NULL, '<p>Zalman ZM500-LE2 - это отличный выбор, если создается домашняя или офисная система с низкими требованиями к питанию, но с высокой совместимостью и надежностью. Этот блок питания построен на платформе, в которой применены схемотехнические решения позволяющие добиться высочайших показателей стабильности электропитания во всём диапазоне нагрузок.</p>\r\n', NULL),
