(4049, 14, NULL, NULL, NULL, NULL, NULL, '<table id=\"PriceTable\">\r\n	<tbody>\r\n		<tr>\r\n			<td>24+8 pin, 24+4 pin, 20+4 pin (разборный 24-pin коннектор. 4-pin могут отстегиваться в случае необходимости, разборный 8-pin коннектор)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL),
(4049, 15, NULL, 450, NULL, NULL, NULL, NULL, NULL),
(4049, 30, NULL, NULL, NULL, NULL, NULL, NULL, 'новый'),
(4066, 14, NULL, NULL, NULL, NULL, NULL, '<p> </p>\r\n\r\n<p>Модель GPS-500A8 относится к новой серии SMART, что предлагает пользователям хорошую производительность наряду с высоким качеством. Блок питания окрашен в чёрный цвет и оснащён длинными «родными» проводами и шнуром питания, а также упакован в твёрдый картон для лучшей защиты. С КПД более 80%, модель GPS-500A8 соответствует экологическим требованиям, имея привлекательную цену.</p>\r\n', NULL),
