(4067, 14, NULL, NULL, NULL, NULL, NULL, '<p>Модель GPS-700A8 относится к новой серии SMART, что предлагает пользователям хорошую производительность наряду с высоким качеством. Блок питания окрашен в чёрный цвет и оснащён длинными «родными» проводами и шнуром питания, а также упакован в твёрдый картон для лучшей защиты. С КПД более 80%, модель GPS-700A8 соответствует экологическим требованиям, имея привлекательную цену.</p>\r\n', NULL),
