(4159, 14, NULL, NULL, NULL, NULL, NULL, '<h2><span style=\"font-size:14px\">Описание</span></h2>\r\n\r\n<p>Мультимедийные стереонаушники с микрофоном. Простая и недорогая компьютерная гарнитура CHAT. Она идеально подходит для компьютерных игр, распознавания речи, интернет-телефонии и работы со всеми приложениями VoIP</p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:12px\">Легкая конструкция</span></li>\r\n	<li><span style=\"font-size:12px\">Накладные амбушюры</span></li>\r\n	<li><span style=\"font-size:12px\">Регулятором громкости</span></li>\r\n</ul>\r\n\r\n<h2><span style=\"font-size:14px\">Основные характеристики</span></h2>\r\n\r\n<table id=\"table_text_product\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><span style=\"font-size:12px\">Диаметр динамика</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">27 мм</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">Импеданс</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">32Ω</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">Чувствительность</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">наушники 105 ± 4 дБ<br />\r\n			микрофон 58 ± 3 дБ</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">Частотный диапазон</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">наушники 20 - 20000 Гц<br />\r\n			микрофон 16 - 16000 Гц</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">Разъем</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">3.5мм / мини-джек</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">Длина кабеля</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">1.8 м</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">Цвет (артикул)</span></p>\r\n\r\n			<p><span style=\"font-size:12px\">черный (PF-CHAT-BLK)</span></p>\r\n\r\n			<p> </p>\r\n\r\n			<p> </p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL),
