(4161, 14, NULL, NULL, NULL, NULL, NULL, '<p>Лёгкая гарнитура, оснащённая накладными амбушюрами и регулятором громкости. Она идеально подходит для компьютерных игр, распознавания речи, интернет-телефонии и работы со всеми приложениями VoIP.</p>\r\n\r\n<ul>\r\n	<li><a href=\"http://www.ritmixrussia.ru/products/rh-512m#spec\">СПЕЦИФИКАЦИЯ</a></li>\r\n</ul>\r\n\r\n<table border=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Тип микрофона</td>\r\n			<td>конденсаторный, всенаправленный</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Диапазон частот наушников</td>\r\n			<td>20 - 20 000 Гц</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Сопротивление наушников</td>\r\n			<td>32 Ом</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Сопротивление микрофона</td>\r\n			<td>2200 Ом</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Чувствительность наушников</td>\r\n			<td>103 дБ</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Чувствительность микрофона</td>\r\n			<td>-58 дБ</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Диаметр излучателя</td>\r\n			<td>27 мм</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Специальные возможности</td>\r\n			<td>регулятор громкости</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Входы</td>\r\n			<td>3,5 мм (мини-джек)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Выходы</td>\r\n			<td>3,5 мм (мини-джек)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Вес</td>\r\n			<td>70 г</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Длина кабеля</td>\r\n			<td>1,8 м</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL),
