(4156, 14, NULL, NULL, NULL, NULL, NULL, '<p>Комфортные амбушюры</p>\r\n\r\n<p>Гарнитура для ПК</p>\r\n\r\n<p>Наушники закрытого типа</p>\r\n\r\n<p>Надежная звукоизоляция</p>\r\n\r\n<p>Регулятор громкости на кабеле</p>\r\n\r\n<p>Переходник-соединитель двух 3,5-мм разъемов (наушник и микрофон) в комбинированный 4-pin аудиоразъем</p>\r\n\r\n<p>Вы можете подключать гарнитуру к планшетам, смартфонам либо ноутбукам нового поколения, использующим 4-пиновый комбинированный разъем для гарнитуры.</p>\r\n', NULL),
