(4191, 14, NULL, NULL, NULL, NULL, NULL, '<table border=\"0\" cellpadding=\"5\" cellspacing=\"10\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"2\">Описание модели</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<p>Компактный коврик для мыши из высококачественной вспененной резины 4мм с плотным тканевым покрытием. Он хорошо прилегает к столу, приятен на ощупь и обеспечивает отличную управляемость мышки при любой чувствительности. Уровень сопротивления – низкий. Размер 220*180 мм. Оптимальный размер для столов с сильно ограниченным свободным пространством. Чёрный цвет основы очень практичен в использовании.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">Технические характеристики</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\"> \r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>Артикул</td>\r\n						<td>PM-H15 Cat</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Тип коврика</td>\r\n						<td>Стандарт, компактный</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Материал основы</td>\r\n						<td>Вспененная резина</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Материал покрытия</td>\r\n						<td>Ткань</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Прошит по периметру (оверлок)</td>\r\n						<td>Нет</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Уровень сопротивления</td>\r\n						<td>Низкий</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Размер (ДШВ), мм</td>\r\n						<td>220*180*4</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL),
