(4074, 14, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Поддержка 22-нм процессоров Intel® Core™ 3 поколения и Intel® Core™ 2 (сокет LGA1155)</li>\r\n	<li>Расширенные возможности интегрированного в ЦП графического ядра Intel HD Graphics 2000/3000</li>\r\n	<li>Реализация на аппаратном уровне шинного интерфейса PCI-Express 3.0</li>\r\n	<li>Инновационная технология Smart 6™ - разумный подход к управлению ПК.</li>\r\n	<li>Уникальная технология On/Off Charge ускоренной зарядки Apple iPad, iPhone и iPod Touch</li>\r\n	<li>Технология DualBIOS™, совместимая с жесткими дисками емкостью свыше 3 Tбайт</li>\r\n	<li>Утилита Touch BIOS™ позволяет легко изменять настойки BIOS без перезагрузки системы</li>\r\n	<li>Инновационный дизайн Ultra Durable 4 Classic</li>\r\n	<li>Полное соответствие отраслевым стандартам качества (твердотельные конденсаторы)</li>\r\n</ul>\r\n', NULL),
(4075, 3, NULL, NULL, NULL, NULL, NULL, NULL, 'LGA 1155'),
(4075, 8, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(4075, 12, NULL, NULL, NULL, NULL, NULL, NULL, '2.0'),
(4075, 14, NULL, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Поддержка 2 поколения процессоров Intel® Core™ в исполнении LGA1155</li>\r\n	<li>Инновационная технология Smart 6™ - разумный подход к управлению ПК.</li>\r\n	<li>Технология DualBIOS™, совместимая с жесткими дисками емкостью свыше 3 Tбайт</li>\r\n	<li>Следующее поколение качества компонентов</li>\r\n	<li>Полное соответствие отраслевым стандартам качества (твердотельные конденсаторы)</li>\r\n</ul>\r\n', NULL),
